(56, 'Clientes', 1, 13, 1305, 0, '', 'Registra los valores a favor del ente económico y a cargo de clientes nacionales y/o extranjeros de cualquier naturaleza, por concepto de ventas de mercancías, productos terminados, servicios y contratos realizados en desarrollo del objeto social, así como la financiación de los mismos.', '0', 1, '2014-06-17 17:13:30', 1, 1, 1),
