(90, 'Inventarios', 1, 14, 14, 0, '', 'Comprende todos aquellos artï¿½culos, materiales, suministros, productos y recursos renovables y no renovables, para ser utilizados en procesos de transformaciï¿½n, consumo, alquiler o venta dentro de las actividades propias del giro ordinario de los negocios del ente econï¿½mico.', '0', 0, '2014-06-17 14:26:25', 1, 1, 1),
(91, 'Materias Primas', 1, 14, 1405, 0, '', 'Registra el valor de los elementos básicos adquiridos a nivel nacional o internacional, para uso en el proceso de fabricación o producción y que requieren procesamiento adicional. El costo lo constituirá el monto total del valor del artículo más los cargos incurridos hasta colocarlos en bodega para ser utilizados.', '0', 0, '2014-06-17 14:26:25', 1, 1, 1),
(92, 'Ajustes por Inflacion', 1, 14, 1405, 140599, '', 'La descripción y dinámica descritas en la reglamentación, solo van hasta las cuentas. De manera que para saber como tratar las subcuentas, hay que observar el comportamiento de la cuenta superior.En este caso; la subcuenta: "140599 Ajustes por inflación" esta dentro de la cuenta 1405 Materias primas Dale clic para observar su descripción y dinámica.', '0', 0, '2014-06-17 14:26:25', 1, 1, 1),
(93, 'Productos Terminados', 1, 14, 1430, 0, '', 'Registra el valor de las existencias de los diferentes bienes cosechados, extraídos o fabricados parcial o totalmente por el ente económico y que se encuentran disponibles para la comercialización.', '0', 0, '2014-06-17 14:31:11', 1, 1, 1),
(94, 'Mercancias no fabricadas por la empresa', 1, 14, 1435, 0, '', 'Registra el valor de los bienes adquiridos para la venta por el ente econï¿½mico que no sufren ningï¿½n proceso de transformaciï¿½n o adiciï¿½n y se encuentran disponibles para su enajenaciï¿½n.', '0', 1, '2014-06-17 14:33:33', 1, 1, 1),
(95, 'Bienes raices para la venta', 1, 14, 1440, 0, '', 'Registra el valor de los terrenos y construcciones que tiene el ente económico totalmente adecuados y terminados y se encuentran disponibles para la venta, tales como terrenos, casas, apartamentos, bodegas, locales, edificios, oficinas, parqueaderos, garajes y bóvedas. El costo del terreno se deberá registrar por separado del costo de la respectiva construcción.', '0', 0, '2014-06-17 14:34:27', 1, 1, 1),
(96, 'Terrenos', 1, 14, 1450, 0, '', 'Registra los costos y demás cargos capitalizables en que incurre el ente económico para la adquisición de terrenos que están destinados para la venta, o construcciones para la venta.Cuenta de uso exclusivo del ente económico dedicado a las actividades de construcción y/o venta de bienes raíces.', '0', 0, '2014-06-17 14:30:02', 1, 1, 1),
(97, 'Materiales, repuestos y accesorios', 1, 14, 1455, 0, '', 'Registra el valor de los elementos que han sido adquiridos por el ente económico para consumir en la producción de bienes fabricados para la venta o en la prestación de servicios en todas y cada una de las operaciones realizadas en su normal funcionamiento. Comprende conceptos tales como elementos necesarios para mantenimiento y reparaciones, herramientas e implementos de trabajo, repuestos para maquinaria y equipo de producción.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(98, 'Propiedades, planta y equipo', 1, 15, 0, 0, '', 'Comprende el conjunto de las cuentas que registran los bienes de cualquier naturaleza que posea el ente económico, con la intención de emplearlos en forma permanente para el desarrollo del giro normal de sus negocios o que se poseen por el apoyo que prestan en la producción de bienes y servicios, por definición no destinados para la venta en el curso normal de los negocios y cuya vida útil exceda de un año.', '0', 0, '2014-06-17 17:40:18', 1, 1, 1),
