(963, 'Productos en proceso', 1, 14, 1410, 0, '', 'Registra el costo de los artículos semielaborados, es decir que poseen un cierto grado de terminación y para lo cual se ha incurrido en costos de materiales, mano de obra y costos indirectos de fabricación requiriendo procesos adicionales para ser convertidos en productos terminados.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(964, 'Ajustes por Inflacion', 1, 14, 1410, 141099, '', NULL, '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(965, 'Obras de Construccion el Curso', 1, 14, 1415, 0, '', 'Registra los diferentes componentes del costo como son: materiales, mano de obra y demás costos de construcción incurridos para el desarrollo de cada obra o frente de trabajo, hasta su traslado a la cuenta 1440 -bienes raíces para la venta-.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(966, 'Ajsutes por Inflacion', 1, 14, 1415, 141599, '', NULL, '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(967, 'Obras de Urbanismo', 1, 14, 1417, 0, '', 'Registra el valor del presupuesto de obra aprobado por la autoridad competente, o el costo real de las obras de urbanismo, en el evento de no haber elaborado dicho presupuesto.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(968, 'Ajustes por Inflacion', 1, 14, 1417, 141799, '', NULL, '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(969, 'Contratos en Ejecucion', 1, 14, 1420, 0, '', 'Registra los diferentes componentes del costo como son: materiales, mano de obra y demás costos de producción o manufactura, incurridos por el ente económico en trabajos que esté ejecutando, así como de construcciones diferentes a bienes raíces para la venta, en cuyo caso se llevarán a la cuenta 1415 -obras de construcción en curso-.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(970, 'Ajustes por Inflacion', 1, 14, 1420, 142099, '', NULL, '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(971, 'Cultivos en Desarrollo', 1, 14, 1425, 0, '', 'Registra los costos en que incurre el ente económico en los procesos de siembra, desarrollo y recolección de productos agropecuarios y/o piscícolas, los cuales son absorbidos en su totalidad, toda vez que su período productivo termina con la primera cosecha.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(972, 'Ajustes por Inflacion', 1, 14, 1425, 142599, '', NULL, '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
(973, 'Plantaciones Agricolas', 1, 14, 1428, 0, '', 'Registra los costos amortizables en que incurre el ente económico en los procesos de adecuación, preparación, siembra y cultivo, toda vez que su producción se efectúa en varias cosechas y cuyo levantamiento o período productivo tiene una duración de 1 a 2 años.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
