(987, 'Envases y Empaques', 1, 14, 1460, 0, '', 'Registra los elementos y materiales adquiridos para ser usados en el empaque o envase de productos tales como cartones, papeles, materiales para tapas, frascos y jarros.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
