(989, 'Inventarios en Transito', 1, 14, 1465, 0, '', 'Se registra en esta cuenta el valor de las erogaciones efectuadas por el ente económico tanto para las importaciones, como para las compras realizadas en el país, desde el momento en que se inicia el trámite hasta cuando ingresan a la bodega como adquisiciones del período, tales como materias primas, suministros y repuestos, materiales, mercancías y subproductos.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
