(991, 'Provisiones', 1, 14, 1499, 0, '', 'Registra los montos provisionados por el ente económico, para cubrir eventuales pérdidas de sus inventarios, por obsolescencia, faltantes, deterioro o pérdida de los mismos, como resultado del análisis efectuado a cada uno de los rubros que conforman el grupo inventarios. Es una cuenta de valuación del activo, de naturaleza crédito.', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
