(1742, 'Cuen tas Corrientes Comerciales', 1, 13, 1310, 0, '0', 'Registra el valor de las operaciones comerciales celebradas entre dos entes económicos, reguladas por las normas legales vigentes. Esta modalidad consiste en un negocio jurídico que tiene por características ser bilateral, oneroso, conmutativo y de ejecución sucesiva, para el cual se acuerdan anotar y compensar en cuenta abierta por debe y haber sus eventuales créditos recíprocos y se establecen condiciones de exigibilidad y disponibilidad del saldo resultante de la compensación progresiva opera', '0', 0, '2014-06-17 14:35:31', 1, 1, 1),
