INSERT INTO `endodoncia_config_consentimiento` (`cod_config_consentimiento`, `nom_config_consentimiento`, `des_config_consentimiento`, `fec_config_consentimiento`, `fec_mod_config_consentimiento`, `cod_usuario`, `cod_empresa`, `cod_estado`) VALUES
(1, 'consentimiento 1', 'De acuerdo con el Código de ética del Odontólogo Colombiano, Capitulo 2, Articulo  19, en pleno uso de mis facultades mentales, Yo {nom_paciente}, identificado con cedula de ciudadanía No. {ced_paciente}, declaro que he asistido por cuenta y voluntad propia al consultorio del Odontólogo Julián Andrés Montoya Rivera, con registro No 0155 de quien he constatado que es graduado de una Universidad Reconocida y que él y su equipo me han informado del diagnostico, pronostico, y tratamiento, así como los riesgos que conlleva dicha intervención, incluyendo anestésicos y demás medicamentos utilizados, complicaciones como fracturas de instrumentos, perforaciones, hemorragias, sobre obturaciones, sub. Obturaciones y  todos los riesgos en tratamientos endodonticos y quirúrgicos así como los beneficios (manejo de dolor, control y manejo de la infección, preservación de la estructura dental y las funciones que cumple) que implica realizar o no establecido en la historia clínica.\r\n\r\nPor lo tanto, dejo constancia que ha quedado suficientemente claro; que he anotado los antecedentes médicos importantes que debe saber el odontólogo sobre el estado general del salud, medicamentos, dosis y el medico responsable del manejo de su condición medica, y de esta manera en mi calidad de tutor responsable del paciente autorizo que se me practiquen los respectivos procedimientos y manejos terapéuticos que se requieren para el tratamiento de mi enfermedad {nom_config_diagnostico}.\r\n\r\nAdemás soy consciente y se me ha explicado, que en caso de no realizarme en el diente la respectiva restauración, o acudir puntual a los controles, correré el riesgo de que el diente se fracture, sufra ataque de caries y/o contamine. Por perdida de selle coronal. Responsabilidad que asumo.\r\n', '2015-09-17 20:28:45', '0000-00-00 00:00:00', 1, 20, 'AAA'),
(2, 'Consentimiento 2', 'De acuerdo con el Código de ética del Odontólogo Colombiano, Capitulo 2, Articulo  19, en pleno uso de mis facultades mentales, Yo {nom_paciente}, identificado con cedula de ciudadanía NO {ced_paciente} de {nom_ciudad}, declaro que he asistido por cuenta y voluntad propia al consultorio  del Odontólogo Julián Andrés Montoya Rivera, con registro No 0155 de quien he constatado que es graduado de una Universidad Reconocida y que él y su equipo me han informado del diagnostico, pronostico, y tratamiento, así como los riesgos que conlleva dicha intervención, incluyendo anestésicos y demás medicamentos utilizados, así como los beneficios (manejo de dolor, control y manejo de la infección, preservación de la estructura dental y las funciones que cumple) que implica realizar o no establecido en la historia clínica.\r\n\r\nAdemás se ha explicado los riesgos que tiene el tratamiento quirúrgico como: retracciones de cicatrización, infección, hemorragia, anestesia y/o parestesia temporal o permanente por causa del procedimiento.  \r\n\r\nPor lo tanto, dejo constancia que ha quedado suficientemente claro; que he anotado los antecedentes médicos importantes que debe saber el odontólogo sobre el estado general del salud, medicamentos, dosis y el medico responsable del manejo de mi condición medica, y de esta manera autorizo que se me practiquen los respectivos procedimientos y manejos terapéuticos que se requieren para el tratamiento de mi enfermedad {nom_config_diagnostico}.\r\n\r\nAdemás soy consciente y se me ha explicado, que en caso de no realizarme en el diente la respectiva restauración, o acudir puntual a los controles, correré el riesgo de que el diente se fracture, sufra ataque de caries y/o contamine. Por perdida de selle coronal. Responsabilidad que asumo.', '2015-10-08 14:01:58', '0000-00-00 00:00:00', 1, 20, 'AAA');
