(24, 23, 2, 1, '2015', 'Es un niÃ±o ordenado y pulcro, debe mejorar su comportamiento ya que en ocasiones se muestra agresivo con sus compaÃ±eros, A nivel cognitivo debe reforzar lo aprendido y cumplir con sus tareas. ', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(25, 24, 2, 1, '2015', 'Es una niÃ±a ordenada, pulcra y respetuosa, disfruta compartir con sus compaÃ±eros y se concentra en las actividades. Debe reforzar abecedario y realizar dictados en casa.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(26, 25, 2, 1, '2015', '', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(27, 26, 2, 1, '2015', 'Es un niÃ±o respetuoso y colaborador, es cumplido con sus tareas. Debe reforzar abecedario y dictados en matemÃ¡ticas, practicar sumas y ubicaciÃ³n correcta de DCU.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(28, 27, 2, 1, '2015', 'Debe practicar lectura y escritura, no reconoce muchas letras y se le evidencia poco acompaÃ±amiento familiar en sus tareas.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(29, 28, 2, 1, '2015', '', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(30, 29, 2, 1, '2015', 'Debe reforzar lectura y escritura, no reconoce letras y se le dificulta prestar atenciÃ³n, tambiÃ©n practicar sumas sencillas. ', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(31, 30, 2, 1, '2015', '', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(32, 31, 2, 1, '2015', 'Es una niÃ±a ordenada y responsable que cumple con tareas. Debe seguir reforzando dictados y practicar mucha lectura.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(33, 32, 2, 1, '2015', 'Es un niÃ±o con muchas capacidades que debe aprovechar ya que demuestra mucho desanimo para responder  con las actividades, no reconoce letras y se muestra agresivo con sus compaÃ±eros.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(34, 33, 2, 1, '2015', 'Se debe reforzar normas y practicar responsabilidades, es desatento y no demuestra interÃ©s por ninguna actividad. A nivel cognitivo no reconoce letras.  Debe reforzar abecedario, hacer dictados y practicar sumas.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(35, 34, 2, 1, '2015', 'Su comportamiento a mejorado se debe seguir trabajando el patrÃ³n de autoridad. A nivel cognitivo se recomienda  realizar dictados diariamente .y  ejercicios  espaciales en la hoja.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(36, 35, 2, 1, '2015', 'Es un niÃ±o activo y colaborador , practica en clase y demuestra interÃ©s en todas las actividades tanto dentro como fuera del aula. Se debe seguir trabajando en la  las practicas de normas ya que se muestra  agresivo y desafiante con sus compaÃ±eros.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(37, 36, 2, 1, '2015', 'A nivel cognitivo demuestra muchas debilidades. Se recomienda reforzar el abecedario , escritura y pronunciaciÃ³n . Se evidencia poca colaboraciÃ³n familiar en el cumplimiento de sus tareas.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(38, 37, 2, 1, '2015', 'Se beben trabajar normas de comportamiento, es desatento y desordenado con sus pertenencias . No trabaja en clase y no cumple con sus tareas.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(39, 38, 2, 1, '2015', 'Se distrae con facilidad. Debe reforzar abecedario, escritura y pronunciaciÃ³n . Practicar dictados diariamente con las letras vistas en clase, combinar y formular frases.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(40, 39, 2, 1, '2015', 'Es un niÃ±o educado y respetuoso. Se recomienda practicar escritura y lectura . AsÃ­ mismo ejercicios de pre escritura  para mejorar su letra. ', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(41, 40, 2, 1, '2015', 'Es una niÃ±a ordenada, colaboradora y muy inteligente. Demuestra habilidades para leer y escribir, es respetuosa con sus pertenencias  y acata normas dentro y fuera del salÃ³n.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(42, 41, 2, 1, '2015', 'Es una niÃ±a respetuosa y colaboradora. A nivel cognitivo demuestra muchas debilidades, no reconocer el abecedario ni las vocales en clase. Se  distrae con facilidad .Se recomienda ejercicios de concentraciÃ³n.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(43, 42, 2, 1, '2015', 'Su inasistencia perjudica su proceso pedagÃ³gico. No reconoce letras ni sonidos, tampoco muestra interÃ©s cuando asiste al colegio y no trae tareas.', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(44, 43, 2, 1, '2015', 'Se recomienda practicar escritura y lectura ya que su inasistencia ha perjudicado su progreso pedagÃ³gico. Debe traer implemento para trabajar.  ', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
(45, 44, 2, 1, '2015', 'Es una niÃ±a ordenada y colaboradora. Su rendimiento acadÃ©mico es bueno. Debe reforzar combinaciones de letras y realizar dictados.  ', '2015-04-19 18:38:40', NULL, 23, 16, NULL),
