(442, 153, 6, 1, '2015', 'El estudiante es indisciplinado en clase, constantemente se le ve entretenido con el celular, no cumple con sus deberes acadÃ©micos obteniendo un bajo rendimiento, molesta a sus compaÃ±eras con apodos. Debe comprometerse a mejorar acadÃ©mica y disciplinariamente ya que indispone al grupo constantemente; el ComitÃ© de EvaluaciÃ³n decide un anota de comportamiento social de 5,0 y una suspensiÃ³n de dos dÃ­as', '2015-04-20 20:06:19', NULL, 21, 16, NULL),
