(10, 'GR-FINGER', 'SCRIPT PARA EL OBJETO GR-FINGER PARA PROCESAMIENTO DE HUELLAS DACTILARES', 'modules/huella/libs/GrFinger.js', '<script FOR="GrFingerX" EVENT="SensorPlug(id)" LANGUAGE="javascript">GrFingerX.CapStartCapture(id);</script>\n<script FOR="GrFingerX" EVENT="SensorUnplug(id)" LANGUAGE="javascript">GrFingerX.CapStopCapture(id);</script>\n<script FOR="GrFingerX" EVENT="ImageAcquired(id, w, h, rawImg, res)" LANGUAGE="javascript">\n	var _id  = document.getElementById(''no_det_huella'').value;\n	var _dir = document.getElementById(''no_ruta_huella_config'').value;\n	var _time=new Date();var _times=_time.getHours()+''-''+_time.getMinutes()+''-''+_time.getSeconds();\n	GrFingerX.CapSaveRawImageToFile(rawImg, w, h, _dir+_id+_times+".bmp", 501);\n	$(''#img_huella'').attr(''src'', _dir+_id+_times+".bmp");\n	$(''#no_img_base'').val(_dir+_id+_times+".bmp");\n	$(''input[name="img_paciente_consentimiento"]'').attr({''readonly'':false});\n	$(''input[name="img_paciente_consentimiento"]'').trigger(''click'');\n	$(''[data="AGREGARHUELLA"]'').attr({''disabled'':true});$(''input[name="img_paciente_consentimiento"]'').attr({''readonly'':true});\n	Finalize();\n</script>\n\n', '<object ID="GrFingerX" CLASSID="CLSID:71944DD6-B5D2-4558-AD02-0435CB2B39DF"></object>', 'src', 'LANGUAGE="JavaScript"', 0, 0),
