INSERT INTO `sys_formulario` (`cod_formulario`, `nom_formulario`, `tit_formulario`, `des_formulario`, `nom_tabla`, `fec_formulario`, `cod_usuario`, `tip_formulario`, `dat_formulario`, `cod_proceso`) VALUES
(1, 'nuevaUsuario', 'Registro de Usuarios', 'En este proceso usted podrÃ¡ crear los usuarios para el sistema, cada usuario tendrÃ¡ el alcance dentro del sistema segÃºn la configuraciÃ³n que usted le registre, tenga en cuenta que los permisos se relacionan a los perfiles creados en la opciÃ³n Sys ConfiguraciÃ³n->Perfiles, y los puede relacionar en la opciÃ³n Sys ConfiguraciÃ³n->Perfil Vs MÃ©todos, estos mÃ©todos son los que definen si un usuario puede: Agregar, Modificar, Consultar o eliminar dentro de cada uno de los procesos restantes, Para poder visualizar un proceso en especifico es necesario asignarlos a cada usuario, esta opciÃ³n la puede encontrar en el siguiente formulario en el panel MenÃºs y sub MenÃºs, las listas son de mÃºltiple selecciÃ³n, seleccione todas las opciones que quiere que un usuario visualice en su secciÃ³n de menÃºs presionando control y con el mouse cliqueando cada uno de los menÃºs, por ultimo relacione la empresa a la cual pertenece y guarde la informaciÃ³n.\r\n\r\n<p></p><strong>Nota: la opcion Activar Ayuda mostrara la explicacion de cada uno de los formularios a cada usuario, para habilitar la ayuda seleccione esta opcion.</strong>', 'sys_usuario', '2014-05-21 00:00:00', 1, 0, 1, 0),
(2, 'nuevaEmpresa', 'Registro de Empresas', 'En el siguiente proceso usted podrÃ¡ registrar empresas en el sistema, dÃ¡ndose el caso de contratar alguno de los mÃ³dulos con un tercero, con esta opciÃ³n usted podrÃ¡ registrar las empresas y los usuarios de estas siempre y cuando no tengan un administrador que lo haga, todos los mÃ³dulos funcionaran independientes a cada empresa, todos los registros y transacciones se cargaran por empresa que registra de esta forma, usted podrÃ¡ manejar el mismo modulo para mÃºltiples empresas sin percances. todos los campos deben ser verÃ­dicos pues estos se imprimirÃ¡n el en contrato fÃ­sico que arroja el sistema. luego de registrar la empresa usted podrÃ¡ asignar los mÃ³dulos en la opciÃ³n Sys Empresa->Empresa Contrato, con esto el sistema des habilitara automÃ¡ticamente el acceso cuando el contrato se venza por fecha, usted tambiÃ©n puede caducarlo manualmente si surge algÃºn problema con el cumplimiento de algÃºn apartado del contrato', 'sys_empresa', '2014-05-21 00:00:00', 1, 0, 1, 0),
(3, 'no aplica', NULL, NULL, 'no aplica', '2014-05-21 00:00:00', 1, 0, 1, 0),
(4, 'MenuUsuario', 'Asignacion de Menus', 'Este proceso se creo independiente para la asignaciÃ³n individual de los menÃºs de los usuarios, recuerde que usted configura el alcance de cada uno de los usuarios del sistema, cada lista en el formulario a continuaciÃ³n es multi selectiva, puede seleccionar todos usuario que manejen un menÃº con las mismas condiciones y luego cliquear el botÃ³n seleccionar todo, el sistema seleccionara automÃ¡ticamente todos los menÃºs de la lista, a continuaciÃ³n guarde la informaciÃ³n, si el usuario ya tiene asignado el menÃº, este no lo registrara nuevamente.', 'sys_usuario_menu', '2014-05-21 00:00:00', 1, 0, 1, 0),
(5, 'subMenuUsuario', 'Asignacion de Sub Menus', 'Este proceso se creo independiente para la asignaciÃ³n individual de los sub menÃºs de los usuarios, recuerde que usted configura el alcance de cada uno de los usuarios del sistema, cada lista en el formulario a continuaciÃ³n es multi selectiva, puede seleccionar todos los usuarios que manejen los mismos sub menÃºs con las mismas condiciones y luego cliquear el botÃ³n seleccionar todo, el sistema seleccionara automÃ¡ticamente todos los sub menÃºs de la lista, a continuaciÃ³n guarde la informaciÃ³n, si el usuario ya tiene asignado el sub menÃº, este no lo registrara nuevamente, recuerde que los sub menÃºs son las opciones que conforman cada menÃº padre de esta secciÃ³n.', 'sys_usuario_menu_sub', '2014-05-21 00:00:00', 1, 0, 1, 0),
(6, 'gestionUsuario', 'Gestion General de Usuarios', 'En la anterior tabla, se listan todos los usuarios configurados en el sistema, con estos usted podrÃ¡ realizar las opciones activadas segÃºn su perfil(Modificar, Eliminar, Activar-Desactivar, Agregar Nuevo), para ejecutar una acciÃ³n directa sobre un usuario en especifico, selecciÃ³nelo con el marcador de la primer columna de la tabla, y a continuaciÃ³n cliquee la opciÃ³n que desea ejecutar, si desea agregar un nuevo usuario, de click en nuevo, el sistema lo redireccionara al formulario de registro de usuario. \r\n<p><p/>La tabla tiene opciones de filtrado, por favor, si necesita ubicar un usuario en especifico digitelo en la casilla Filtro, el sistema listara los usuarios segÃºn las palabras que usted digite, tambiÃ©n puede seleccionar las columnas de la tabla que desea visualizar, de click en la opciÃ³n columnas y seleccione las que desea ver, el sistema quitara las que no estÃ¡n seleccionadas, de esta forma puede acceder a informaciÃ³n especifica de cada usuario, igualmente puede listar el numero de registros que desea ver por pagina, de click en la lista donde se encuentra por defecto el numero 10 y seleccione el numero de filas que desea ver, en la parte inferior de la tabla estÃ¡n el numero de paginas por las cuales puede navegar para visualizar los registros.', 'sys_usuario', '2014-05-21 00:00:00', 1, 0, 1, 0),
(7, 'nuevaEmpresaVsContrato', 'Asignacion de Contrato por Empresa', 'En el siguiente proceso, usted podrÃ¡ asignar los contratos que se configuran en el menÃº Sys Contrato a las empresas que utilizan la aplicaciÃ³n, la vigencia de los mÃ³dulos dependen exclusivamente del tiempo de cada contrato, si el contrato caduca, se deberÃ¡ cambiar su fecha o en su defecto asignar otra clase de contrato a la empresa por la utilizaciÃ³n de cualquier modulo.', 'sys_empresa_contrato', '2014-05-21 00:00:00', 1, 0, 1, 0),
(8, 'editarPerfil', NULL, NULL, 'sys_usuario', '2014-05-21 00:00:00', 1, 0, 1, 0),
