(20, 'nuevaNumeracion', 'Registro y Modificación de Numeraciones', 'En el siguiente proceso usted podrá crear y parametrizar las numeraciones que aplican para la creación de cotizaciones y facturas, tenga en cuenta que todos los campos son obligatorios, los campos de selección especifican la siguiente información:\r\n<br>Numeración Preferida: Indica si esta numeración es la que se cargara siempre por defecto a la hora de crear un documento (Cotización y/o Factura).\r\n<br>Autoincrementable: Indica si la numeración se auto incrementa automáticamente al ser seleccionada, de igual forma el campo de numeración es editable si prefiere colocar la numeración manualmente.\r\n<br>Numeración para Facturación: Indica si la actual numeración aplica para el proceso de creación de facturas.\r\n<br>Numeración para Cotización:  Indica si la actual numeración aplica para el proceso de creación de cotizaciones.\r\n', 'fa_numeracion', '2014-05-21 00:00:00', 1, 0, 0, 0),
