(31, 'nuevaFactura', 'Registro de Cotizaciones', 'En este proceso usted podrÃ¡ registrar las cotizaciones de su empresa, se debe tener en cuenta que una cotizaciÃ³n no es una factura oficial, pero puede cambiar el estado una vez se apruebe la orden de compra por el cliente, para realizar el proceso de registro , es importante saber que todos los campos son obligatorios, la numeraciÃ³n es cargada de acuerdo a la configuraciÃ³n de la misma, el cliente igualmente y segÃºn su configuraciÃ³n en el registro, cargara automÃ¡ticamente las fechas de pago segÃºn su tipo de pago, esto con el fin de agilizar el proceso, las observaciones no son imprimibles con la cotizaciÃ³n pero si las notas, y el campo asigna a. es para asignar la cotizaciÃ³n que se esta registrando a un usuario de la empresa para hacer seguimiento a la misma mediante el modulo service desk, usted podrÃ¡ tambiÃ©n cargar todos los items que desee a una cotizaciÃ³n, y luego modificarlos o aplicar descuentos o impuesto adicionales segÃºn la negociaciÃ³n con el cliente. al seleccionar el Ã­tem, este cargara por defecto: referencia, valor sin impuestos, 1 cantidad y calculara el valor automÃ¡ticamente, si usted desea, podrÃ¡ cambiar estos valores posteriormente. ', 'fa_factura', '2014-05-05 00:00:00', 1, 0, 1, 10),
