(45, 'nuevaRestaurante', 'Registro de Restaurantes', 'En esta seccion usted podra registrar los restaurantes y configurarlos para vizualizarlos en su app, para este proceso se deben tener en cuenta los siguientes apartados.<p><p><li>Todos los campos son obligatorios para el proceso</li><li>El campo Estado siempre debe ser AAA</li><p>A continuacion Guarde la informacion y siga con el siguiente menu</p>', 'lc_restaurantes', '2014-07-14 00:00:00', 1, 0, 1, 0),
(46, 'Gestion Imagenes', NULL, NULL, 'lc_restaurantes_img', '2014-07-14 00:00:00', 1, 0, 0, 0),
(47, 'restaurantes_img', 'Registro de Imagenes', 'En esta seccion se pueden registrar las imagenes de los restaurantes, estas mismas pueden ser configuradas para que se puedan visualizar en los distintos apartados de la app, para registrar y configurar las imagenes tenga en cuenta los siguiente: <p><p><li>Todos los campos son obligatorios para el proceso</li><li>Img App: esta imagen se visualizara en el filtro principal de la app</li><li>Img Header: esta imagen se visualizara en el encabezado de la informacion del restaurante</li><li>Img Footer: esta imagen se visualizara en el pie de pagina de la informacion del restaurante</li><li>Img Publicidad: esta es la imagen para el banner de publicidad del la pagina principal de la app</li><p></p>Para finalizar el estado siempre debe ser AAA', 'lc_restaurantes_img', '2014-07-14 00:00:00', 1, 0, 1, 0),
