(57, 'nuevaFormulario', 'Registro de Formularios', 'Luego de crear el esquema en la base de datos, cree el formulario que gestionara cada una de las tablas de dicho esquema, con este proceso, podrÃ¡ gestionar mÃ©todos como agregar, borrar, desactivar entre otros para una sola tabla. el nombre esquema debe ser exactamente igual al nombre de la tabla que esta gestionando de la base de datos. Igualmente puede registrar la documentaciÃ³n de cada uno de los formularios del sistema donde se especifica la funcionalidad y el proceso que realiza cada uno, esta ayuda se activa cada usuario en la opciÃ³n modificar usuario y chequeando el indicador de ayuda.<p></p>El campo "Proceso Contable Asociado" aplica Ãºnicamente para los procesos contables, los cuales, requieren de este campo para los movimientos internos del sistema. para este ultimo, tenga en cuenta lo que indica su contador o asesor contable.\r\n', 'sys_formulario', '2014-05-21 00:00:00', 1, 0, 1, 0),
