(63, 'nuevaDetFrame', 'Detalle del frame', 'En el siguiente proceso, usted podra registrar, modificar y eliminar todos los componentes de un frame de un formulario determinado, los componentes de los frames son los encargados de recoger la informacion que se desea insertar en las tablas del sistema, entre estos se encuentran: cajas de texto, combos, checkbox, radios, textarea, los componentes pueden ser difinidos por tamaÃ±os para su presentacion en la interfaz, partiendo de 1 pÃ ra un caracter visible hasta 12, estos seran distribuidos y cargados en los frames en el orden en que sean guardados, si desea agregar mas componentes, pulse agregar item, caso contrario, pulse eliminar item, si el componente es un combo o lista, debe seleccionar la tabla referencia para que es sistema llene este componente con los datos de dicha tabla.', 'sys_detframe', '2014-07-23 00:00:00', 1, 0, 1, 0),
