(65, 'nuevaCarta', 'Registro de Cartas', 'En este proceso se podra llevar a cabo el registro de cartas de cada uno de los restaurantes, antes de ejecutar en registro de los mencionado anteriormente, se debe registrar el restaurante con toda su configuracion, las cartas son dividas en tres modalidades (Entrantes, Platos, Postres), una carta puede ser configurada con las tres modalidades, pero no se pueden realizar registros sin elegir al menos una de estas, por este motivo, todos los campos son obligatorios para el proceso, luego de el registro debe verificar la informacion desde la app.', 'lc_carta', '2014-07-23 00:00:00', 1, 0, 1, 0),
