(69, 'nuevaCategoriasSub', 'Registro de Sub Categorias', 'Las sub categorias son necesarias para la clasificacion de los restaurantes, un restaurantes puede pertencer a varias sub cateogiras, entre mas completa sea la informacion de cada restaurante, sera encontrado con mayor relevancia en el filtro de la app, todos los restaurantes muestran en forma de tag las sub categorias a las cuales pertenecen en la informacion general, tambien se pueden encontrar en tipos de comida, el cual desglosa de manera facil, todos los restaurantes por sub categorias. todos los campos son obligatorios para este proceso, el finalizar este proceso, relacione los restaurantes por sub categorias en la opcion del menu.', 'lc_categorias_sub', '2014-08-13 00:00:00', 1, 0, 1, 0),
