(204, 'Carga Academica', 'Gestion Carga Academica', 'En la anterior tabla, se listan todos los registros configurados en el sistema, con estos usted podrÃ¡ realizar las opciones activadas segÃºn su perfil(Modificar, Eliminar, Activar-Desactivar, Agregar Nuevo), para ejecutar una acciÃ³n directa sobre un registro en especifico, selecciÃ³nelo con el marcador de la primer columna de la tabla, y a continuaciÃ³n cliquee la opciÃ³n que desea ejecutar, si desea agregar un nuevo registro, de click en nuevo, el sistema lo redireccionara al formulario de registro. La tabla tiene opciones de filtrado, por favor, si necesita ubicar un registro en especifico digitelo en la casilla Filtro, el sistema listara los registros segÃºn las palabras que usted digite, tambiÃ©n puede seleccionar las columnas de la tabla que desea visualizar, de click en la opciÃ³n columnas y seleccione las que desea ver, el sistema quitara las que no estÃ¡n seleccionadas, de esta forma puede acceder a informaciÃ³n especifica de cada registro, igualmente puede listar el numero de registros que desea ver por pagina, de click en la lista donde se encuentra por defecto el numero 10 y seleccione el numero de filas que desea ver, en la parte inferior de la tabla estÃ¡n el numero de paginas por las cuales puede navegar para visualizar los registros.', 'sined_carga_academica', '2015-04-07 06:20:06', 1, 0, 1, 0),
(205, 'NuevaCargaAcademica', 'AsignaciÃ³n de Carga Academica', 'En el siguiente proceso se puede asignar la carga acadÃ©mica a cada docente, para el proceso todos los campos son obligatorios, seleccione inicialmente el docente al cual desea registrar la carga acadÃ©mica, agregue cuantos items sean necesarios segÃºn la carga acadÃ©mica con el botÃ³n agregar item, para eliminar filas, presione el botÃ³n eliminar item, seleccione los demÃ¡s campos y guarde la informaciÃ³n.', 'sined_carga_academica', '2015-04-07 06:20:06', 1, 0, 0, 0),
(206, 'Notas', 'Registro de Notas', 'En el siguiente formulario usted podra encontrar los datos requeridos para cargar la planilla de calificaciones como se explican a continuacion:<p></p>\r\n<li><strong>Docente:</strong> se debe cargar su mismo nombre, por favor seleccionelo,  con este dato se cargara y se habilitara la lista de materias / asignaturas relacionadas a su carga academica.\r\n<li><strong>Materia / Asignatura:</strong> En esta lista se cargan las materias relacionadas a su carga academica, por favor seleccione la asignatura a la cual desea registra las notas.\r\n<li><strong>Grupo:</strong> posteriormente a filtrar las materias, se cargaran en esta lista, los grupos relacionados en su carga academica, por favor seleccione el grupo al cual desea generar la plantilla de calificaciones.\r\n<li><strong>Periodo Academico:</strong> en esta lista se cargara el periodo academico parametrizado por el administrador del sistema, solo estara habilitado segun su fecha de caducidad.<p></p>\r\n<div class="alert alert-warning fade in"><button class="close" data-dismiss="alert">Ã—</button><i class="fa-fw fa fa-warning"></i>Nota: si desea revisar las planillas que han sido generadas, filtre los datos y presione el boton generar, si ya existe informacion en las bases de datos de sined, el sistema mostrara los cambios, de lo contrario la plantilla cargara vacia. Si desea realizar algun tipo de cambio a las planillas de calificacion, contacte al administrador del sistema.</div>', 'sined_notas', '2015-04-07 06:24:12', 1, 0, 1, 0),
