(220, 'Verificacion Planillas', 'Verificacion de Planillas por Periodo', 'En la anterior tabla, se listan las planillas generadas por periodo, aquÃ­ se pueden detallar los grupos, materias, docentes responsables de las diferentes Ã¡reas segÃºn su carga acadÃ©mica y el estado actual de la planilla "Generada" o "sin Generar", partiendo de esta informaciÃ³n, se pude determinar que grupos faltan por una determinada nota segÃºn la asignatura e igualmente que docente es el responsable de subir esta plantilla de notas. usted puede filtrar todo tipo de bÃºsquedas sobre el informe, digitando por ejemplo el nombre del docente en la casilla de bÃºsqueda o el grupo, si usted desea, tambiÃ©n puede exportar estas estadÃ­sticas e excel, pdf o simplemente copiar o imprimir la informaciÃ³n, utilizando las opciones de la parte superior de la tabla.', 'sined_planilla_periodo', '2015-04-15 14:49:00', 1, 0, 1, 0),
(221, 'NuevaVerificacionPlanillas', NULL, NULL, 'sined_planilla_periodo', '2015-04-15 14:49:01', 1, 0, 0, 0),
(222, 'Planillas Docente', 'Verificacion de Planillas por Periodo y Docente', 'En la anterior tabla, se listan las planillas generadas por periodo y docente, aquÃ­ se pueden detallar los grupos, materias  de las diferentes Ã¡reas segÃºn su carga acadÃ©mica y el estado actual de la planilla "Generada" o "sin Generar", partiendo de esta informaciÃ³n, se pude determinar que grupos faltan por una determinada nota segÃºn la asignatura e igualmente que docente es el responsable de subir esta plantilla de notas. usted puede filtrar todo tipo de bÃºsquedas sobre el informe, digitando por ejemplo el grupo, si usted desea, tambiÃ©n puede exportar estas estadÃ­sticas e excel, pdf o simplemente copiar o imprimir la informaciÃ³n, utilizando las opciones de la parte superior de la tabla.', 'sined_planilla_periodo', '2015-04-15 22:34:45', 1, 0, 1, 0),
