(224, 'Boletines Academicos', 'Generacion de Boletines Academicos por Periodo', 'En el siguiente formulario usted podra encontrar los datos requeridos para generar los boletines acadamicos segun el periodo actual y el año lectivo actual, el sistema generara un archivo pdf con las calificaciones de todo un grupo, con lo que ahorrara tiempo unicamente imprimiendo un solo archivo. A continuacion se precisa como funciona cada uno de los componente de la interfaz:<p></p>\r\n<li><strong>Grupo / Grado / Ciclo:</strong> cargue el grupo al cual desea generar el archivo de boletines academicos.\r\n<li><strong>Periodo Academico:</strong> seleccione en esta lista el periodo para el cual desea cargar los boletines, el periodo es parametrizable y unicamente se mostraran los periodos activos.\r\n<li><strong>Tipo Impresion:</strong> selecciones entre la lista de tipos de impresion, la que usted considere mas acorde para el tipo de archivo que esta generando.\r\n<li><strong>Ruta:</strong> este datos es opcional, si usted desea que el archivo se guarde automiticamente luego de ser generado, coloque la ruta donde usted desea sea guardado, este campo debe ir sin comillas simples ni dobles, unicamente la ruta de su directorio por ejemplo:  Cmiarchivomisboletines, si deja el campo en blanco, el sistema generara el archivo directamente en el navegador. <p></p>\r\n<div class="alert alert-warning fade in"><button class="close" data-dismiss="alert">Ã—</button><i class="fa-fw fa fa-warning"></i>Nota: recuerde que el campo ruta es opcional, y debe conocer el comportamiento del sistema operativo al momento de sacar la ruta de sus directorio raiz, siendo el caso de preferir guardar el archivo generado.</div>', 'sined_boletines', '2015-04-16 23:01:04', 1, 0, 1, 0),
(225, 'NuevaBoletinesAcademicos', NULL, NULL, 'sined_boletines', '2015-04-16 23:01:04', 1, 0, 0, 0),
(226, 'Valoracion Descriptiva', 'Registro Valoracion Descriptiva', 'En el siguiente formulario usted podrÃ¡ encontrar los datos requeridos para cargar la planilla de valoraciÃ³n descriptiva como se explican a continuaciÃ³n:<p></p>\r\n<li><strong>Docente:</strong> se debe cargar su mismo nombre, por favor selecciÃ³nelo,  con este dato se cargara y se habilitara la lista de materias / asignaturas relacionadas a su carga acadÃ©mica.\r\n<li><strong>Grupo:</strong> en esta lista se cargaran los grupos a su cargo "Director de grupo", para que realice el registro de las observaciones de cada estudiante del grupo.\r\n<li><strong>Periodo AcadÃ©mico:</strong> en esta lista se cargara el periodo acadÃ©mico parametrizado por el administrador del sistema, solo estarÃ¡ habilitado segÃºn su fecha de caducidad.<p></p>\r\n<div class="alert alert-warning fade in"><button class="close" data-dismiss="alert">Ã—</button><i class="fa-fw fa fa-warning"></i>Nota: si desea revisar las planillas que han sido generadas, filtre los datos y presione el botÃ³n generar, si ya existe informaciÃ³n en las bases de datos de sined, el sistema mostrara los cambios, de lo contrario la plantilla cargara vacÃ­a. Si desea realizar algÃºn tipo de cambio a las planillas de calificaciÃ³n, vaya al menÃº Gestion Valoracion Des.</div>', 'sined_valoracion_descriptiva', '2015-04-17 11:50:19', 1, 0, 1, 0),
