(277, 'configEndodoncia', 'Gestion General de Configuracion', 'En la anterior tabla, se listan todos los registros configurados en el sistema, con estos usted podrá realizar las opciones activadas según su perfil(Modificar, Eliminar, Activar-Desactivar, Agregar Nuevo), para ejecutar una acción directa sobre un registro en especifico, selecciónelo con el marcador de la primer columna de la tabla, y a continuación cliquee la opción que desea ejecutar, si desea agregar un nuevo registro, de click en nuevo, el sistema lo redireccionara al formulario de registro. <p></p>La tabla tiene opciones de filtrado, por favor, si necesita ubicar un registro en especifico digitelo en la casilla Filtro, el sistema listara los registros según las palabras que usted digite, también puede utilizar las acciones del menú guardar como para exportar los registros, guardarlos o imprimirlos, igualmente puede listar el numero de registros que desea ver por pagina, de click en la lista donde se encuentra por defecto el numero 10 y seleccione el numero de filas que desea ver, en la parte inferior de la tabla están el numero de paginas por las cuales puede navegar para visualizar los registros.', 'endodoncia_config', '2015-07-25 21:17:07', 1, 0, 1, 0),
(278, 'NuevaconfigEndodoncia', 'Configuracion / Parametrizacion General', 'En el siguiente proceso usted podrÃ¡ registrar las configuraciones generales  que utilizara el modulo de endodoncia para enviar correos electrÃ³nicos con las notificaciones que emite el sistema a los pacientes o a los usuarios, puede crear todas las configuraciones que desee, pero unidamente puede tener activa una, al cambiar de estado a activo a una de sus configuraciones, se desactivaran las demÃ¡s automÃ¡ticamente.  ', 'endodoncia_config', '2015-07-25 21:17:07', 1, 0, 0, 0),
