(287, 'Config Dental', 'Gestion General Estructura Dental', 'En la anterior tabla, se listan todos los registros configurados en el sistema, con estos usted podrá realizar las opciones activadas según su perfil(Modificar, Eliminar, Activar-Desactivar, Agregar Nuevo), para ejecutar una acción directa sobre un registro en especifico, selecciónelo con el marcador de la primer columna de la tabla, y a continuación cliquee la opción que desea ejecutar, si desea agregar un nuevo registro, de click en nuevo, el sistema lo redireccionara al formulario de registro. La tabla tiene opciones de filtrado, por favor, si necesita ubicar un registro en especifico digitelo en la casilla Filtro, el sistema listara los registros según las palabras que usted digite, también puede seleccionar las columnas de la tabla que desea visualizar, de click en la opción columnas y seleccione las que desea ver, el sistema quitara las que no están seleccionadas, de esta forma puede acceder a información especifica de cada registro, igualmente puede listar el numero de registros que desea ver por pagina, de click en la lista donde se encuentra por defecto el numero 10 y seleccione el numero de filas que desea ver, en la parte inferior de la tabla están el numero de paginas por las cuales puede navegar para visualizar los registros.', 'endodoncia_config_dental', '2015-08-22 12:01:09', 1, 0, 1, 0),
(288, 'NuevaConfigDental', 'Registro de Estructura Dental', 'En el siguiente formulario usted podrá registrar los datos requeridos para la estructura dental la cual se cargara en la historia clínica del paciente como se explican a continuacion:<p></p>\r\n<li><strong>Imagen de Odontrograma:</strong> se debe seleccionar el diente que se desea parametrizar, es obligatorio seleccionar antes de registrar cualquiera de los datos del formulario, de lo contrario no podrá agregar mas items.\r\n<li><strong>Datos para la creación de la estructura dental</strong> En este panel usted podrá registrar la información necesaria para identificar cada uno de los dientes según estén seleccionados, puede agregar mas filas para configurar toda la estructura dental, de click en el botón "Agregar Item", también puede eliminar items con el botón "Eliminar Item", cada fila se configura según el diente que halla seleccionado, tenga en cuenta que debe llenar de una vez todos los datos del diente que seleccione para evitar perdida de información.\r\n<p></p>\r\n<div class="alert alert-warning fade in"><button class="close" data-dismiss="alert"> x </button><i class="fa-fw fa fa-warning"></i>Nota: La siguiente configuración debe ser guardada con datos reales de un odontograma humano, estos datos se mostraran en la historia clínica del paciente señalando la ubicación directa sobre la imagen.</div>', 'endodoncia_config_dental', '2015-08-22 12:01:09', 1, 0, 0, 0),
(289, 'index', NULL, NULL, 'sys_agenda', '2015-08-22 12:01:09', 1, 0, 0, 0),
(290, 'Config Nomenclatura', 'Gestión General Nomenclatura Dental', 'En la anterior tabla, se listan todos los registros configurados en el sistema, con estos usted podrá realizar las opciones activadas según su perfil(Modificar, Eliminar, Activar-Desactivar, Agregar Nuevo), para ejecutar una acción directa sobre un registro en especifico, selecciónelo con el marcador de la primer columna de la tabla, y a continuación cliquee la opción que desea ejecutar, si desea agregar un nuevo registro, de click en nuevo, el sistema lo redireccionara al formulario de registro. La tabla tiene opciones de filtrado, por favor, si necesita ubicar un registro en especifico digitelo en la casilla Filtro, el sistema listara los registros según las palabras que usted digite, también puede seleccionar las columnas de la tabla que desea visualizar, de click en la opción columnas y seleccione las que desea ver, el sistema quitara las que no están seleccionadas, de esta forma puede acceder a información especifica de cada registro, igualmente puede listar el numero de registros que desea ver por pagina, de click en la lista donde se encuentra por defecto el numero 10 y seleccione el numero de filas que desea ver, en la parte inferior de la tabla están el numero de paginas por las cuales puede navegar para visualizar los registros.', 'endodoncia_config_nomenclatura', '2015-08-26 19:06:56', 1, 0, 1, 0),
(291, 'NuevaConfigNomenclatura', 'Registro nomenclatura dental', 'En este proceso usted podrá registrar la nomenclatura relacionada a cada diente, con el propósito de cargar únicamente las casillas que se deben utilizar estrictamente por cada uno de los dientes en la historia clínica del paciente, tenga en cuenta que los datos deben configurarse antes de registrar una historia medica y no durante este proceso puesto que el formato carga según dicha parametrizacion, si tiene dudas consulte a su administrador.', 'endodoncia_config_nomenclatura', '2015-08-26 19:06:56', 1, 0, 0, 0),
