(347, 'Certificados Academicos', 'Gestion General de Certificados Academicos', 'En el siguiente formulario usted podra encontrar los datos requeridos para generar los Certificados acadamicos segun el periodo actual y el año lectivo actual, el sistema generara un archivo pdf con las calificaciones de todo un grupo, con lo que ahorrara tiempo unicamente imprimiendo un solo archivo. igualemente podra generar el certificado del alumno que seleccione en la lista de alumnos. A continuacion se precisa como funciona cada uno de los componente de la interfaz:<p></p>\r\n<li><strong>Grupo / Grado / Ciclo:</strong> cargue el grupo al cual desea generar el archivo de boletines academicos.\r\n<li><strong>Alumnos:</strong> seleccione en esta lista el alumno al cual desea generar el certificado academico.\r\n<li><strong>Periodo Academico:</strong> seleccione en esta lista el periodo para el cual desea cargar los boletines, el periodo es parametrizable y unicamente se mostraran los periodos activos.\r\n<li><strong>Tipo Impresion:</strong> selecciones entre la lista de tipos de impresion, la que usted considere mas acorde para el tipo de archivo que esta generando.\r\n<li><strong>Ruta:</strong> este datos es opcional, si usted desea que el archivo se guarde automiticamente luego de ser generado, coloque la ruta donde usted desea sea guardado, este campo debe ir sin comillas simples ni dobles, unicamente la ruta de su directorio por ejemplo:  Cmiarchivomisboletines, si deja el campo en blanco, el sistema generara el archivo directamente en el navegador. <p></p>\r\n<div class="alert alert-warning fade in"><button class="close" data-dismiss="alert">Ã—</button><i class="fa-fw fa fa-warning"></i>Nota: recuerde que el campo ruta es opcional, y debe conocer el comportamiento del sistema operativo al momento de sacar la ruta de sus directorio raiz, siendo el caso de preferir guardar el archivo generado.</div>', 'sined_certificados', '2015-12-03 18:53:16', 1, 0, 1, 0),
