INSERT INTO `sys_tablareferencia` (`cod_tablareferencia`, `nom_referencia`, `sql_esquema`, `ind_actualiza`, `nro_columnas`, `met_nuevo`) VALUES
(1, 'sys_ciudad', 'SELECT cod_ciudad as col1, nom_ciudad, dpt_ciudad FROM sys_ciudad', 0, 3, '?app=c2lzdGVtYQ==&met=Y2l1ZGFk&arg=MSw0OSxudWV2YUNpdWRhZCo2NQ=='),
(2, 'fa_regimen', 'SELECT cod_regimen as col1, nom_regimen, des_regimen FROM fa_regimen', 1, 3, NULL),
(3, 'sys_contrato', 'SELECT cod_contrato as col1, nom_contrato, des_contrato FROM sys_contrato', 1, 3, NULL),
(4, 'mod_modulo', 'SELECT cod_modulo as col1, nom_modulo, des_modulo FROM mod_modulo', 1, 3, NULL),
(5, 'fa_moneda', 'SELECT cod_moneda as col1, abr_moneda, nom_moneda FROM fa_moneda', 1, 3, NULL),
(6, 'sys_perfil', 'SELECT cod_perfil as col1, nom_perfil, des_perfil FROM sys_perfil', 1, 3, NULL),
(7, 'sys_empresa', 'SELECT t1.cod_empresa as col1, t1.nom_empresa, t1.nit_empresa FROM sys_empresa as t1, sys_usuario_empresa as t2  WHERE t1.cod_empresa = t2.cod_empresa AND t2.cod_usuario = codUsu', 1, 3, NULL),
(8, 'sys_menu', 'SELECT t1.cod_menu as col1, t1.nom_menu, t1.des_menu FROM sys_menu as t1, sys_usuario_menu as t2 WHERE t1.cod_menu  =  t2.cod_menu AND t2.cod_usuario = codUsu', 1, 3, NULL),
(9, 'sys_menu_sub', 'SELECT t1.cod_menu_sub as col1, t1.nom_menu_sub, t1.des_menu_sub FROM sys_menu_sub as t1, sys_usuario_menu_sub as t2  WHERE t1.cod_menu_sub    =  t2.cod_menu_sub AND t2.cod_usuario = codUsu AND t1.ind_principal=1 GROUP BY t2.cod_menu_sub', 1, 3, NULL),
(10, 'sys_usuario', 'SELECT t1.cod_usuario, t2.nom_usuario, t2.ape_usuario FROM sys_usuario_empresa as t1, sys_usuario as t2 WHERE t1.cod_usuario = t2.cod_usuario AND t1.cod_empresa in(SELECT cod_empresa  FROM sys_usuario_empresa WHERE cod_usuario=codUsu) AND t1.cod_usuario <> codUsu GROUP BY t1.cod_usuario', 1, 3, NULL),
