(92, 'datolee_sector', 'SELECT cod_sector, ''sector: '', nom_sector FROM datolee_sector WHERE cod_estado = ''AAA'' AND cod_empresa in(SELECT cod_empresa FROM sys_usuario_empresa WHERE cod_usuario=codUsu)', 1, 3, NULL),
