CREATE DEFINER=`root`@`localhost` PROCEDURE `pbActualizaConfig`(cCaseTabla int(1),cCodConfig int(8))
BEGIN
 CASE cCaseTabla
  WHEN 0 THEN
  -- configuracion general modulo de facturacion
	UPDATE fa_config 
       SET cod_estado = 'BBB'
     WHERE cod_config <> cCodConfig;
  WHEN 1 THEN
  -- configuracion general modulo de help desk
	UPDATE hd_config 
       SET cod_estado = 'BBB'
     WHERE cod_config <> cCodConfig;
  WHEN 2 THEN
  -- configuracion general modulo del sistema  
	UPDATE sys_config 
       SET cod_estado = 'BBB'
     WHERE cod_config <> cCodConfig; 
  WHEN 3 THEN
  -- configuracion general modulo de sined
	UPDATE sined_config 
       SET cod_estado = 'BBB'
     WHERE cod_config <> cCodConfig;
  WHEN 4 THEN
  -- configuracion general modulo de stk  
	UPDATE stk_config 
       SET cod_estado = 'BBB'
     WHERE cod_config <> cCodConfig;
  WHEN 5 THEN
  -- configuracion general modulo de datolee  
	UPDATE datolee_config 
       SET cod_estado = 'BBB'
     WHERE cod_config <> cCodConfig; 
  WHEN 6 THEN
  -- configuracion general modulo de endodoncia 
	UPDATE endodoncia_config 
       SET cod_estado = 'BBB'
     WHERE cod_config <> cCodConfig;
 END CASE;
END$$

