CREATE DEFINER=`root`@`localhost` PROCEDURE `pbActualizaNumeracion`(cCodNumeracion int(8),cCodEmpresa int(8),cTipo int(1))
BEGIN
	UPDATE fa_numeracion 
       SET ind_preferida_numeracion = 0,
           cod_estado               = 'BBB'
     WHERE cod_numeracion <> cCodNumeracion
       AND cod_empresa=cCodEmpresa
	   AND IF(cTipo=1, ind_cotizacion=1, ind_factura=1);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pbActualizaSigNum`()
BEGIN
 DECLARE cNumSig int(8);
-- Obtengo el siguiente numero para actualizar la facturacion
 SELECT num_sig_numeracion+1
   INTO cNumSig
   FROM fa_numeracion
  WHERE cod_estado='AAA'
    AND ind_preferida_numeracion=1;
-- Actualizamos el siguiente numero de la configuracion de facturacion prefererida
 UPDATE fa_numeracion 
	SET num_sig_numeracion=cNumSig
  WHERE cod_estado='AAA'
    AND ind_preferida_numeracion=1;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pbArmaVistaTabla`(IN `cNomTabla` VARCHAR(45), OUT `cDesError` VARCHAR(2000), OUT `cNumError` INT(1))
BEGIN
 DECLARE done           BOOL         DEFAULT FALSE;
 DECLARE cSentencia     LONGTEXT     DEFAULT '';
 DECLARE cColumnasVista LONGTEXT     DEFAULT '';
 DECLARE cCommentColumn VARCHAR(200) DEFAULT '';
 DECLARE cNomColumn     VARCHAR(200) DEFAULT '';
 DECLARE curComment CURSOR FOR 
  SELECT COLUMN_COMMENT, COLUMN_NAME
    FROM information_schema.COLUMNS
   WHERE TABLE_SCHEMA = 'appmoduler'
     AND TABLE_NAME = cNomTabla; 
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN curComment;
  curCommentLoop: LOOP
  FETCH curComment INTO cCommentColumn, cNomColumn; 
   IF done THEN
    CLOSE curComment;
    LEAVE curCommentLoop;
   END IF; 
   SET cColumnasVista =  CONCAT(cColumnasVista,cNomTabla,'.',cNomColumn,' AS ',cCommentColumn,',');
   
  END LOOP;
  SET cDesError = cColumnasVista;
END$$

