CREATE DEFINER=`root`@`localhost` PROCEDURE `pbConvierteCotizacion`(cNumCot int(8),cCodUsu int(8),cCodEmp int(8),cVenta int(8))
BEGIN
 DECLARE done1 BOOL DEFAULT FALSE;
 DECLARE cNumFac varchar(45);
 DECLARE cFecIni date;
 DECLARE cFecVen date; 
 DECLARE cValida int(1);
 DECLARE cItemInv int(8);
 DECLARE cCanItem int(8);
 DECLARE cCodInv  int(8);
 DECLARE cSumInv  float(20,2);
-- Cursor para aplicar el inventario a los items que lo requieran
 DECLARE cursorInventario CURSOR FOR
  SELECT cod_item,sum(can_detalle),sum(imp_detalle)/sum(can_detalle),cod_inventario  
    FROM fa_detalle
   WHERE cod_factura=cNumCot
GROUP BY cod_item,cod_inventario;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done1 = TRUE;
-- Valido que la orden tenga adjunto para convertirla a factura
 SET cValida=0;
 SELECT ind_adjunto
   INTO cValida
   FROM fa_orden
  WHERE cod_factura=cNumCot;
-- Si hay adjunto continua con el proceso
IF cValida=1 Or cVenta=1 THEN
-- Obtengo el siguiente numero para actualizar la facturacion
 SELECT concat(pre_numeracion,num_sig_numeracion+1)  
   INTO cNumFac	
   FROM fa_numeracion
  WHERE cod_estado='AAA'
    AND ind_preferida_numeracion=1;
-- Traemos las fechas de inicio y vencimiento de la factura segun el cliente
SELECT DATE(now()) fecActual,DATE(DATE_ADD(now(), INTERVAL t2.num_dias_tipopago DAY))  
  INTO cFecIni,cFecVen
  FROM fa_cliente as t1, fa_tipopago as t2, fa_factura as t3
 WHERE t1.cod_tipopago = t2.cod_tipopago
   AND t1.cod_cliente  = t3.cod_cliente
   AND t3.cod_factura = cNumCot;
-- actualizao la cotizacion con el numero de factura para convertirla en factura
 UPDATE fa_factura
    SET num_factura=cNumFac,ind_cotizacion=0,fec_alta_factura=cFecIni,fec_vencimiento_factura=cFecVen
  WHERE cod_factura=cNumCot;
-- Actualizamos el inventario con los items registrados en el detalle de la factura
OPEN cursorInventario;
  cursorInventarioLoop: LOOP
  FETCH cursorInventario INTO cItemInv, cCanItem, cSumInv, cCodInv;
   IF done1 THEN
	CLOSE cursorInventario;
	LEAVE cursorInventarioLoop;
   END IF;
    CALL pbTratarInventario(cCodInv,cCanItem,cSumInv,2,cCodUsu,cCodEmp,0,1);
   END LOOP;
-- Actualizamos la numeracion
call pbActualizaSigNum();
END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pbGeneraAgendaMedica`(codAgenda int(8),codMedico int(8),fecInicio datetime,fecFin datetime,horaAm int(8),horaPm int(8),intHoras int(8),indDomingo int(1),codEmp int(8),codEst varchar(3),codUsu int(8),out cDesError varchar(2000),out cNumError int(1))
BEGIN
 DECLARE iNumDias           INT(10)       DEFAULT 0;  -- Define el numero de dias de la agenda, entre fecha inicio y fecha fin
 DECLARE iDiaSemana         INT(8)        DEFAULT 0;  -- Define el identificador del dia segun la semana, para descartar los domingos
 DECLARE iClicloDias        INT(8)        DEFAULT 0;  -- Define el ciclo para recorrer la agenda de citas
 DECLARE cFecAgenda         DATE          DEFAULT ''; -- Define el dia para la agenda 
 DECLARE iHoraInicio        TIME          DEFAULT ''; -- Define la hora en que inician las citas
 DECLARE iHoraFin           TIME          DEFAULT ''; -- Define la hora en que finalizan las citas
 DECLARE iHoraAgenda        TIME          DEFAULT ''; -- Define la hora de la agenda
 DECLARE iNumHorasAm        INT(8)        DEFAULT 0;  -- Define el numero de horas de trabajo manaña
 DECLARE iNumHorasPm        INT(8)        DEFAULT 0;  -- Define el numero de horas de trabajo tarde
 DECLARE iCicloHorasAm      INT(8)        DEFAULT 0;  -- Define el ciclo para recorrer y generar las horas segun horas de trabajo manaña
 DECLARE iCicloHorasPm      INT(8)        DEFAULT 0;  -- Define el ciclo para recorrer y generar las horas segun horas de trabajo tarde
 DECLARE iCountHoras        int(8)        DEFAULT 0;  -- acumula los minutos de las horas
 DECLARE iDuracionCitas     int(8)        DEFAULT 0; 
 DECLARE indAm              int(1)        DEFAULT 0;
 DECLARE indPm              int(1)        DEFAULT 0;
 DECLARE iUltHora           TIME          DEFAULT '';
 -- Obtenemos la duracion de las citas segun la configuracion
 SELECT duracion_cita_config
   INTO iDuracionCitas
   FROM endodoncia_config
  WHERE cod_estado  = 'AAA'
    AND cod_empresa = codEmp ;
 -- Obtenemos los dias entre fechas
 SET iNumDias    = DATEDIFF(fecFin,fecInicio);
 -- Definimos ind mañana y tarde para la agenda
 SET indAm = IF(TIME(fecInicio) BETWEEN '00:00' AND TIME('12:00'),1,0);
 SET indPm = IF(TIME(fecFin) BETWEEN TIME('12:01') AND TIME('23:59'),1,0);
 -- Calculamos numero de horas segun parametros
 SET iNumHorasAm = ROUND((horaAm*60)/iDuracionCitas);
 SET iNumHorasPm = ROUND((horaPm*60)/iDuracionCitas);
 -- Ciclo de agendamiento
 WHILE iNumDias>-1 DO
  -- Obtenemos las fechas de las agendas para generar los horarios
  SET cFecAgenda = DATE_SUB(DATE(fecFin),INTERVAL iNumDias DAY);
  -- Obtenemos el identificador del dia segun la semana 1-dom,2-lun,3-mar,4-mie,5-jue,6,vie,7-sab
  SET iDiaSemana = DAYOFWEEK(cFecAgenda);
 -- Inicializamos los contadores
  SET iCountHoras  =0;
  SET iCicloHorasAm=iNumHorasAm;
  SET iCicloHorasPm=iNumHorasPm;
 -- Obtenemos la Hora Inicial y la hora final
  SET iHoraInicio = TIME(fecInicio);  
  SET iHoraFin    = TIME(fecFin); 
  SET iHoraAgenda = '';
 -- Obtenemos las horas para la agenda de la mañana
  IF indAm=1 THEN
   WHILE iCicloHorasAm>0 DO
	IF iHoraAgenda<iHoraFin THEN
     SET iHoraAgenda = DATE_ADD(iHoraInicio, INTERVAL iCountHoras MINUTE);
		  VALUES (codAgenda,cFecAgenda,iHoraAgenda,DATE_ADD(iHoraAgenda, INTERVAL iDuracionCitas MINUTE),now(),codUsu,codEmp,'AAA',iDiaSemana); 
     SET iCountHoras = iCountHoras+iDuracionCitas;
	END IF;
    SET iUltHora = iHoraAgenda;
    SET iCicloHorasAm = iCicloHorasAm-1;
   END WHILE;
  END IF;
  -- Inicializamos el contador de horas en 0 por cada ciclo
  SET iCountHoras=0;
  -- Obtenemos las horas para la agenda de la tarde
  IF indPm=1 THEN
   SET iHoraInicio = IF(indAm=1,DATE_ADD(iUltHora,INTERVAL (intHoras+iDuracionCitas) MINUTE),iHoraInicio);
   WHILE iCicloHorasPm>0 DO
    IF iHoraAgenda<iHoraFin THEN
	 SET iHoraAgenda = DATE_ADD(iHoraInicio, INTERVAL iCountHoras MINUTE);
		  VALUES (codAgenda,cFecAgenda,iHoraAgenda,DATE_ADD(iHoraAgenda, INTERVAL iDuracionCitas MINUTE),now(),codUsu,codEmp,'AAA',iDiaSemana);
     SET iCountHoras = iCountHoras+iDuracionCitas;
	END IF;
    SET iCicloHorasPm = iCicloHorasPm-1;
   END WHILE;
  END IF;
  SET iNumdias = iNumDias-1;
 END WHILE;
 -- Eliminamos si es el caso la agenda del domingo
 IF indDomingo=0 THEN
  DELETE
    FROM endodoncia_agenda_citas
   WHERE cod_agenda_medica=codAgenda
     AND id_dia_agenda_citas=1;
 END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pbNuevaNotificacionTarea`(cCodCliente int(8),codEmpresa int(8),cCodUsuario int(8),cCodNotificacion int(8), auxMsj varchar(1000), cfecha datetime, out cDesError varchar(2000),out cNumError int(1))
BEGIN
 DECLARE cMsjNotificacion       varchar(120);  -- mensaje de la tabla sys_notificacion_msj
 DECLARE cIconMejNotificacion   varchar(100);  -- icono configurado para este mensaje
 DECLARE iTipMsjNotificacion    int    (1);    -- tipo de notificacion (notificacion o tarea)
 DECLARE iColMsjNotificacion    varchar(40);   -- Color para mostrar la notificacion
 DECLARE cMsj                   varchar(1000); -- variable para configurar el mensaje a guardar en sys_notificacion
 DECLARE cNomCliente            varchar(400);  -- nombre del cliente segun empresa
 DECLARE iNumID                 varchar(30);   -- numero de identificacion, varchar por que a veces utilizan otros signos
-- seleccionamos los datos del cliente segun la empresa
-- iniciamos el mensaje de error para las trazas
SET cDesError = 'recuperando informacion del cliente';
CASE codEmpresa
  WHEN 20 THEN -- mi endodoncia
 IF cCodCliente<>-1 THEN
  SELECT concat(nom1_paciente, ' ', nom2_paciente, ' ', ape1_paciente, ' ', ape2_paciente), ced_paciente
    INTO cNomcliente, iNumId 
    FROM endodoncia_paciente
   WHERE cod_paciente = cCodCliente;
 ELSE
  SET cNomcliente='';
  SET iNumID='';
 END IF;
END CASE;
-- seleccionamos los datos de la configuracion de la notificacion segun su id(parametro de entrada)
-- mensaje de error para las trazas
 SET cDesError = 'recuperando informacion del la config notificacion ';
 SELECT des_notificacion_msj,  color_notificacion_msj, icon_notificacion_msj, tipo_notificacion_msj
   INTO cMsjNotificacion, iColMsjNotificacion, cIconMejNotificacion, iTipMsjNotificacion
   FROM sys_notificacion_msj
  WHERE cod_notificacion_msj = cCodNotificacion; 
-- armamos el mensaje de la notificacion
-- mensaje de error para las trazas 
 SET cDesError = 'armando el mensaje para la insercion';  
 SET cMsj = REPLACE(REPLACE(REPLACE(cMsjNotificacion, '{nom_paciente}', cNomcliente),'{ced_cliente}',iNumID),'{aux_mensaje}',auxMsj);
-- se inserta la nueva notificacion
-- mensaje de error para las trazas
 SET cDesError = 'insertando la notificacion';  
	  VALUES (cMsj,cfecha,cIconMejNotificacion,iColMsjNotificacion,iTipMsjNotificacion,'AAA',cCodUsuario,codEmpresa);

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pbNuevoAlquiler`(cCodCliente int(8),cCodVehiculo int(9),cCase int(1))
BEGIN
 DECLARE cHuella varchar(120);
 CASE TRIM(cCase)
  WHEN 1 THEN
-- Seleccionamos la huella del registro
  SELECT huella_cliente_vehiculo
    INTO cHuella
    FROM hue_cliente_vehiculo
   WHERE cod_cliente=cCodCliente
     AND cod_vehiculo=cCodVehiculo
     AND cod_estado='AAA'; 
-- Actualizamos el estado del vehiculo
  UPDATE hue_vehiculo 
     SET cod_estado='VAA'
   WHERE cod_vehiculo = cCodVehiculo;
-- Actualizamos el estado del cliente y la huella
  UPDATE hue_cliente 
     SET cod_estado = 'CVA', huella_cliente=cHuella  
   WHERE cod_cliente = cCodCliente;
 WHEN 2 THEN
	-- Seleccionamos la huella del registro
  SELECT huella_cliente_vehiculo
    INTO cHuella
    FROM hue_cliente_vehiculo
   WHERE cod_cliente=cCodCliente
     AND cod_vehiculo=cCodVehiculo
     AND cod_estado='AAA'; 
-- Actualizamos el estado del vehiculo
  UPDATE hue_vehiculo 
     SET cod_estado='AAA'
   WHERE cod_vehiculo = cCodVehiculo;
-- Actualizamos el estado del cliente y la huella
  UPDATE hue_cliente 
     SET cod_estado = 'AAA', huella_cliente=cHuella  
   WHERE cod_cliente = cCodCliente;
END CASE;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pbNuevoServicio`(cCodServicio int(9),cCodUsuario int(9),cCodUsuarioRegistro int(9), cCodCliente int(8),cCadServicio varchar(20), cIndAsigna int(1), cCodEstado varchar(3),cNombreCliente varchar(500),out cDesError varchar(2000),out cNumError int(1))
BEGIN
 DECLARE cNomCliente varchar(120);
 DECLARE cDescripcion varchar(4000);
 DECLARE cFecAlta timestamp DEFAULT now();
 DECLARE cEstado varchar(120);
 DECLARE cCategoria varchar(100);
 DECLARE cReferencia varchar(100);
 DECLARE cVerifica int(1);
 DECLARE cEmpresa int(8);
-- seleccionamos cliente para hacer referencia al servicio
 IF cCodCliente<>-1 THEN
  SELECT concat(nom_cliente, email_cliente) 
    INTO cNomcliente
    FROM fa_cliente
   WHERE cod_cliente = cCodCliente;
 ELSE
  SET cNomcliente=cNombreCliente;
 END IF;
-- seleccionamos el estado del servicio
 SELECT des_estado 
   INTO cEstado
   FROM sys_estado
  WHERE cod_estado = cCodEstado; 
-- seleccionamos el tipo de tiquet
 SELECT t1.nom_categorias, t3.nom_referencia,t2.cod_empresa 
   INTO cCategoria, cReferencia, cEmpresa
   FROM hd_categorias as t1, hd_servicio as t2, hd_referencia as t3
  WHERE t1.cod_categorias=t2.cod_categorias
    AND t2.cod_referencia=t3.cod_referencia
    AND t2.cod_servicio=cCodServicio;
-- verificamos que el tiquet no se encuentre asignado
 SELECT COUNT(1)
   INTO cVerifica
   FROM hd_servicio
  WHERE cod_estado='STR'
    AND cod_servicio=cCodServicio;
 IF cVerifica=0 THEN
-- armamos el mensaje del servicio
  SET cDescripcion = concat('Ha sido asignado el siguiente tiquet a su Service desk - ',' Servicio: ', cCodServicio,' Categoria: ', cCategoria,' Referencia: ', cReferencia,' Cliente: ',cNomCliente,' Fecha de apertura: ', cFecAlta,' Estado actual: ', cEstado);
  SET cCadServicio=cDescripcion;
  SET cDesError='El tiquet a sido asignado satisfactoriamente. ';
  SET cNumError=6;
-- se inserta el servicio
 /*INSERT INTO hd_servicio(cod_servicio,des_servicio, fec_servicio, ind_asigna, cod_referencia, cod_estado, cod_usuario)
	  VALUES (cCodServicio,cCadServicio,cFecAlta,cIndAsigna,cCodReferencia,cCodEstado,cCodUsuarioRegistro);*/
-- se inserta la asignacion
	   VALUES (cCodServicio,cDescripcion,cCodUsuario,cFecAlta,cCodUsuarioRegistro,cEmpresa,'STR');
-- Actualizamos la fecha de asignacion y estado del servicio	
  UPDATE hd_servicio 
     SET fec_asignado=cFecAlta,cod_estado='STR'
   WHERE cod_servicio=cCodServicio;
 ELSE
  SET cDesError='El tiquet ya se encuentra asignado. Debe realizarce la respectiva gestion antes de asignarlo nuevamente. ';
  SET cNumError=2;
 END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pbTransaccionContable`(cCategoria int(8),cImp float(20,2),cCase int(1),cProceso int(8),cAsiento int(8),cObs varchar(2000),cFecTransaccion datetime,cCodUsu int(8),cCodEmp int(8))
BEGIN
