CREATE DEFINER=`root`@`localhost` PROCEDURE `pbTratarInventario`(cCodInv int(4),cCanInv int(8),cImp float(20,2),cCase int(1),cCodUsu int(8),cCodEmp int(8),cAjuste int(1),cVenta int(1))
BEGIN
 DECLARE cExtistencias  int(8);
 DECLARE cEntradas      int(8);
 DECLARE cSalidas       int(8);
 DECLARE cImpInv        float(20,2);
 DECLARE cTotalInv	    float(20,2);
 DECLARE cPromPonderado float(20,2) default 0;
 DECLARE cItem          varchar(45);
 DECLARE cTInv          float(20,2);
 DECLARE cFecMov        datetime default now();
 CASE cCase
-- case para cuendo sea primer registro de inventario
  WHEN 0 THEN
		 VALUES (cCodInv,cCanInv,cImp,1,cFecMov,cCodUsu,cCodEmp);
-- Actualizo la tabla de inventario con el nuevo valor promedio ponderado
	UPDATE fa_inventario
       SET imp_pro_ponderado_inventario=cImp
	 WHERE cod_inventario=cCodInv;
-- inserto la notificacion informativa para la empresa
		 VALUES (concat('Se ha registrado en inventario del Item: ',cItem, ' tenga en cuenta verificar la lista de precios para los posibles cambios.'),'fa-money',
                 cFecMov,'NAA',cCodUsu,cCodEmp);
-- Caso para cuando el inventario sea de entrada 
  WHEN 1 THEN
-- inserto la novedad para el inventario para la auditoria
		 VALUES (cCodInv,cCanInv,cImp,1,cFecMov,cAjuste,cCodUsu,cCodEmp,cVenta);
-- trato la tabla de inventario para realizar las modificaciones respctivas
	SET cTInv=cImp*cCanInv;
    SELECT concat(t1.nom_item,' - ',t1.ref_item),sum(t2.entrada_inventario+cCanInv),sum(t2.existencia_inventario+cCanInv),sum(t2.total_inventario+cTInv)
	  INTO cItem,cEntradas,cExtistencias,cTotalInv
      FROM fa_item as t1,fa_inventario as t2
	 WHERE t1.cod_item=t2.cod_item
       AND t2.cod_inventario = cCodInv;
-- actualizo la tabla de inventario con los nuevos valores
	SET cPromPonderado=cTotalInv/cExtistencias;
	UPDATE fa_inventario
       SET entrada_inventario=cEntradas,existencia_inventario=cExtistencias,total_inventario=cTotalInv,
           imp_pro_ponderado_inventario=cPromPonderado,fec_ult_entrada_inventario=cFecMov,ind_ajuste=cAjuste
	 WHERE cod_inventario=cCodInv;
-- inserto la notificacion informativa para la empresa
		 VALUES (concat('Se ha registrado una entrada de inventario del Item: ',cItem, ' tenga en cuenta verificar la lista de precios para los posibles cambios.'),'fa-money',
                 cFecMov,'NAA',cCodUsu,cCodEmp);
-- Caso para cuando el inventario sea de salida 
  WHEN 2 THEN
-- inserto la novedad para el inventario para la auditoria
		 VALUES (cCodInv,cCanInv,cImp,1,cFecMov,cAjuste,cCodUsu,cCodEmp,cVenta);
-- trato la tabla de inventario para realizar las modificaciones respctivas
	SET cTInv=cImp*cCanInv;
    SELECT concat(t1.nom_item,' - ',t1.ref_item),sum(t2.salida_inventario+cCanInv),sum(t2.existencia_inventario-cCanInv),sum(t2.total_inventario-cTInv)
	  INTO cItem,cSalidas,cExtistencias,cTotalInv
      FROM fa_item as t1,fa_inventario as t2
	 WHERE t1.cod_item=t2.cod_item
       AND t2.cod_inventario = cCodInv;
-- actualizo la tabla de inventario con los nuevos valores
	SET cPromPonderado=cTotalInv/cExtistencias;
	UPDATE fa_inventario
       SET salida_inventario=cSalidas,existencia_inventario=cExtistencias,total_inventario=cTotalInv,
           imp_pro_ponderado_inventario=cPromPonderado,fec_ult_salida_inventario=cFecMov,ind_ajuste=cAjuste
	 WHERE cod_inventario=cCodInv;
-- inserto la notificacion informativa para la empresa
		 VALUES (concat('Se ha registrado una salida de inventario del Item: ',cItem, ' tenga en cuenta verificar la lista de precios para los posibles cambios.'),'fa-money',
                 cFecMov,'NAA',cCodUsu,cCodEmp);
 END CASE;
END$$

