CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaCuenta`(cCadenaGrupo int(2)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE done  BOOL DEFAULT FALSE;
 DECLARE cCadenaNombre     longtext DEFAULT '';
 DECLARE cCadenaCuenta      INT(4);
 DECLARE cCadenaSubCuenta   INT(6);
 DECLARE cCadCuenta         longtext DEFAULT '';
 DECLARE cCadsubCuenta      longtext DEFAULT '';
 DECLARE Cuenta CURSOR FOR 
  SELECT concat(nom_cuenta,' - ',cuenta_cuenta), cuenta_cuenta, sub_cuenta
    FROM con_cuenta 
   WHERE grupo_cuenta=cCadenaGrupo
     AND cuenta_cuenta>0
	 AND sub_cuenta=0
ORDER BY cuenta_cuenta ASC;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN Cuenta;
  CuentaLoop: LOOP
  FETCH Cuenta INTO cCadenaNombre,cCadenaCuenta,cCadenaSubCuenta; 
   IF done THEN
    CLOSE Cuenta;
    LEAVE CuentaLoop;
   END IF;
   SET cCadsubCuenta=fbArmaSubCuenta(cCadenaCuenta);
   SET cCadCuenta=concat(cCadCuenta,'<li style="display:none"><span><i class="fa fa-lg fa-plus-circle"></i> ',cCadenaNombre,'</span>',cCadsubCuenta,'</li>'); 
  END LOOP;
RETURN concat('<ul>',cCadCuenta,'</ul>');
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaCuentasContables`() RETURNS longtext CHARSET utf8
BEGIN
 DECLARE done  BOOL DEFAULT FALSE;
 DECLARE cCadenaCuentas    longtext DEFAULT '';
 DECLARE cCadenaFinCuentas longtext DEFAULT '';
 DECLARE cCadClase		   longtext DEFAULT '';
 DECLARE cCadenaClase      INT(1);
 DECLARE cCadenaGrupo      longtext DEFAULT '';
 DECLARE cNomCuenta        longtext DEFAULT '';
 DECLARE Clase CURSOR FOR 
  SELECT nom_cuenta,clase_cuenta
    FROM con_cuenta
GROUP BY clase_cuenta
ORDER BY clase_cuenta ASC;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN Clase;
  ClaseLoop: LOOP
  FETCH Clase INTO cNomCuenta,cCadenaClase; 
   IF done THEN
    CLOSE Clase;
    LEAVE ClaseLoop;
   END IF;
   SET cCadenaGrupo=fbArmaGrupo(cCadenaClase); 
   SET cCadClase=concat(cCadClase,
                           '<li style="display:none"><span><i class="fa fa-lg fa-plus-circle"></i> ',cNomCuenta,'</span>',cCadenaGrupo,'</li>');
  END LOOP;
  set cCadenaFinCuentas = concat('<ul><li><span><i class="fa fa-lg fa-folder-open"></i> PUC (Plan Unico de Cuentas)</span><ul>',cCadClase,'</ul></li></ul>');
RETURN cCadenaFinCuentas;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaEvolucioneDientePaciente`(cCodDiente int(8),cCodPaciente int(8)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE cCadenaEvolucion     LONGTEXT   DEFAULT '';
 DECLARE cDesEvolucion        LONGTEXT   DEFAULT '';
 DECLARE cHorEntradaEvolucion VARCHAR(8) DEFAULT '';
 DECLARE cHoraSalidaEvolucion VARCHAR(8) DEFAULT '';
 DECLARE cFechaEvolucion      DATETIME   DEFAULT '';
 DECLARE cCadenaFinal         LONGTEXT   DEFAULT '';
 DECLARE done                 BOOL       DEFAULT FALSE;
 DECLARE cursorEvoluciones CURSOR FOR
  SELECT t1.des_paciente_evolucion,t1.hora_entrada_paciente_evolucion,t1.hora_salida_paciente_evolucion,t1.fec_paciente_evolucion
    FROM endodoncia_paciente_evolucion as t1, endodoncia_historia_clinica as t2, endodoncia_config_dental as t3
   WHERE t1.cod_historia_clinica=t2.cod_historia_clinica
     AND t2.cod_config_dental=t3.cod_config_dental
	 AND t2.cod_paciente=cCodPaciente
	 AND t3.cod_imagen_dental=cCodDiente
ORDER BY cod_paciente_evolucion desc;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;
 OPEN cursorEvoluciones;
  cursorEvolucionesLoop: LOOP
  FETCH cursorEvoluciones INTO cDesEvolucion,cHorEntradaEvolucion,cHoraSalidaEvolucion,cFechaEvolucion;
   IF done THEN
    CLOSE cursorEvoluciones;
    LEAVE cursorEvolucionesLoop;
   END IF;
   SET cCadenaEvolucion = CONCAT(cCadenaEvolucion,CONCAT('Evolucion: ' ,cDesEvolucion,' Hora_Entrada: ',cHorEntradaEvolucion,' Hora_Salida:',cHoraSalidaEvolucion,' Fecha:',cFechaEvolucion,'\n\n'));
 END LOOP;
 SET cCadenaFinal = cCadenaEvolucion;
RETURN cCadenaFinal;
END$$

