 DECLARE Frame CURSOR FOR 
  SELECT CASE t1.tip_frame
          WHEN 0 THEN CONCAT('<div class="col-lg-',t1.id_frame,'" ',IF(t1.ind_visible=0,'style="display:none;background-color:none;"','style="background-color:none;"'),' id="',t1.nom_tabla,'"><div class="panel panel-default"><div class="panel-heading"><h4><span>',t1.nom_frame,'</span></h4></div><div class="panel-body">')
		  WHEN 1 THEN CONCAT('<div class="col-lg-',t1.id_frame,'" ',IF(t1.ind_visible=0,'style="display:none;background-color:none;"','style="background-color:none;"'),' id="',t1.nom_tabla,'"><div class="panel panel-default"><div class="panel-heading"><h4><span>',t1.nom_frame,'</span></h4></div><div class="panel-body">',t1.aux_frame,'</div>')
         END, t1.cod_frame, t2.nom_formulario, t2.nom_tabla, t2.cod_formulario,t3.cod_menu_sub,t2.cod_proceso, t1.tip_frame,t1.ind_enlinea     
    FROM sys_frame as t1   , sys_formulario as t2, 
		 sys_menu_sub as t3, sys_usuario_menu_sub as t4 
   WHERE t3.cod_menu_sub            = t4.cod_menu_sub
     AND t1.cod_formulario          = t2.cod_formulario
     AND t3.cod_formulario_asociado = t1.cod_formulario
     AND t3.cod_formulario_asociado = codFrm
     AND t4.cod_usuario             = codUsu 
     AND t4.cod_menu_sub            = codSubM
     AND t1.tip_frame in(0,1)
ORDER BY t1.cod_indice ASC; 
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 set tDatos=iDatos;
 OPEN Frame;
  FrameLoop: LOOP
  FETCH Frame INTO cCadenaFrame, cCodFrame, cNomForm, cNomTabla, cCodFrm, cCodMenuSub, cProceso, iTipoFrame,iIndLinea;
   IF done THEN
    CLOSE Frame;
    LEAVE FrameLoop;
   END IF;
   set cCadenaFinFrm = cCadenaFrame;
   set cCadenaInp = fbArmaInput(cCodFrame, codUsu, tDatos,cCiclo,cModulo,cMetodo);
   set cCadenaFinFrm = CONCAT(cCadenaFinFrm,cCadenaInp,IF(iIndLinea=0,cFinFrame,'</div></div>'));
   set cCadenaFinal  = CONCAT(cCadenaFinal,cCadenaFinFrm); 
  END LOOP;
RETURN CONCAT(cCadenaFinal,IF(iIndLinea=1,'</div>',''),'<input type="hidden" name="no_nom_tabla" value="',cNomForm,'"><input type="hidden" name="no_esq_tabla" value="',cNomTabla,'"><input type="hidden" name="no_id_formulario" value="',cCodFrm,'"><input type="hidden" name="no_cod_menu_sub" value="',cCodMenuSub,'"><input type="hidden" name="no_cod_proceso_interno" value="',cProceso,'">');
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaFormularioModal`(codFrm int(2),codUsu int(8)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE done  BOOL DEFAULT FALSE;
 DECLARE cCodFrame     int(8);
 DECLARE cCodFrm       int(8);   
 DECLARE tDatos        int(1);
 DECLARE iTipoFrame	   int(1);
 DECLARE cCadenaFrame  varchar(10000) DEFAULT '';
 DECLARE cCadenaInp    longtext DEFAULT '';
 DECLARE cCadenaFinFrm longtext DEFAULT '';
 DECLARE cCadenaFinal  longtext DEFAULT '';
 DECLARE cCodMenuSub   int(8);
 DECLARE cNomTabla     varchar(45);
 DECLARE cNomForm      varchar(45); 
 DECLARE cProceso      int(8);
 DECLARE cFinFrame     varchar(2000)  DEFAULT '</div><div class="modal-footer">
                                                                  <button type="button" class="btn btn-default" id="bto_enviar">Agregar</button>
									                              <button type="button" class="btn btn-primary" id="bto_editar" disabled>Editar</button>
                                                                  <button type="button" class="btn btn-danger" id="bto_eliminar" disabled>Eliminar</button>
																 </div></div></div></form>';
 DECLARE Frame CURSOR FOR 
  SELECT CONCAT('<form id="form" data="{FORM_CONTROLLER}" name="modal_',t1.nom_tabla,'" id="modal_',t1.nom_tabla,'" class="form-horizontal"><div class="modal fade" id="remoteModal" tabindex="-1" role="dialog" aria-labelledby="remoteModalLabel" aria-hidden="true"><div class="modal-dialog"><div class="modal-content"><div class="modal-header"><button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button><h4 class="modal-title" id="myModalLabel"></h4></div><div class="modal-body">'),
         t1.cod_frame, t2.nom_formulario, t2.nom_tabla, t2.cod_formulario,t2.cod_proceso, t1.tip_frame     
    FROM sys_frame as t1   , sys_formulario as t2 
   WHERE t1.cod_formulario          = t2.cod_formulario
     AND t2.cod_formulario          = codFrm
     AND t1.tip_frame=3
ORDER BY t1.cod_indice ASC; 
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN Frame;
  FrameLoop: LOOP
  FETCH Frame INTO cCadenaFrame, cCodFrame, cNomForm, cNomTabla, cCodFrm, cProceso, iTipoFrame;
   IF done THEN
    CLOSE Frame;
    LEAVE FrameLoop;
   END IF;
   set cCadenaFinFrm = cCadenaFrame;
   set cCadenaInp = fbArmaInput(cCodFrame, codUsu, 1,1,2,'N');
   set cCadenaFinFrm = CONCAT(cCadenaFinFrm,cCadenaInp,cFinFrame);
   set cCadenaFinal  = CONCAT(cCadenaFinal,cCadenaFinFrm); 
  END LOOP;
RETURN CONCAT(cCadenaFinal,'<input type="hidden" name="no_nom_tabla" value="',cNomForm,'"><input type="hidden" name="no_esq_tabla" value="',cNomTabla,'"><input type="hidden" name="no_id_formulario" value="',cCodFrm,'"><input type="hidden" name="no_cod_proceso_interno" value="',cProceso,'">');
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaGrupo`(cCadenaClase int(1)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE done  BOOL DEFAULT FALSE;
 DECLARE cCadenaNombre     longtext DEFAULT '';
 DECLARE cCadenaGrupo      INT(2);
 DECLARE cCadenaCuenta     INT(4);
 DECLARE cCadGrupo         longtext DEFAULT '';
 DECLARE cCadCuenta        longtext DEFAULT '';
 DECLARE Grupo CURSOR FOR 
  SELECT concat(nom_cuenta,' - ',grupo_cuenta), grupo_cuenta, cuenta_cuenta
    FROM con_cuenta 
   WHERE clase_cuenta=cCadenaClase
     AND grupo_cuenta>0 
	 AND cuenta_cuenta=0 
     AND sub_cuenta=0
ORDER BY grupo_cuenta ASC;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN Grupo;
  GrupoLoop: LOOP
  FETCH Grupo INTO cCadenaNombre,cCadenaGrupo,cCadenaCuenta; 
   IF done THEN
    CLOSE Grupo;
    LEAVE GrupoLoop;
   END IF;
   SET cCadCuenta=fbArmaCuenta(cCadenaGrupo);
   SET cCadGrupo=concat(cCadGrupo,'<li><span><i class="fa fa-lg fa-plus-circle"></i>', cCadenaNombre,'</span>',cCadCuenta,'</li>'); 
  END LOOP;
RETURN concat('<ul>',cCadGrupo,'</ul>');
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaHistorialPagos`(cHistoriaClinica int(8)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE cCadenaEvolucion     LONGTEXT      DEFAULT '';
 DECLARE cNumSigIngreso       LONGTEXT      DEFAULT '';
 DECLARE cImpPago             FLOAT(20,2)   DEFAULT '';
 DECLARE cObsPago             VARCHAR(2000) DEFAULT '';
 DECLARE cNotPago             VARCHAR(2000) DEFAULT '';
 DECLARE cFecPago             DATETIME      DEFAULT '';
 DECLARE cCadenaFinal         LONGTEXT      DEFAULT '';
 DECLARE done                 BOOL          DEFAULT FALSE;
 DECLARE cursorHistorial CURSOR FOR
  SELECT t2.num_sig_comp_ingreso,t2.imp_pago,t2.obs_pago,t2.not_pago,t2.fec_pago 
    FROM endodoncia_pago_detalle as t1, endodoncia_pago as t2 
   WHERE t1.cod_pago=t2.cod_pago
     AND t1.cod_historia_clinica=cHistoriaClinica
ORDER BY t1.cod_pago_detalle desc;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;
 OPEN cursorHistorial;
  cursorHistorialLoop: LOOP
  FETCH cursorHistorial INTO cNumSigIngreso,cImpPago,cObsPago,cNotPago,cFecPago;
   IF done THEN
    CLOSE cursorHistorial;
    LEAVE cursorHistorialLoop;
   END IF;
   SET cCadenaEvolucion = CONCAT(cCadenaEvolucion,CONCAT('Numero Comprobante: ' ,cNumSigIngreso,' - Importe Abonado: ',cImpPago,' - Observacion:',cObsPago,' - Notas:',cNotPago,' - Fecha y Hora: ',cFecPago,'\n\n'));
 END LOOP;
 SET cCadenaFinal = cCadenaEvolucion;
RETURN cCadenaFinal;
END$$

