CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaImgEmpresa`(codUsuario int(8)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE done BOOL DEFAULT FALSE;
 DECLARE sImgEmp varchar(10000);
 DECLARE cCadImg longtext DEFAULT '';
 DECLARE cCabSli longtext DEFAULT '';
 DECLARE indPpal int(1)   DEFAULT 0;
 DECLARE cCiclo  int(8)   DEFAULT 0;
 DECLARE imgEmpresa CURSOR FOR 
  SELECT IF(t1.img_empresa IS NOT NULL OR t1.img_empresa<>'',CONCAT('<div class="item ',IF(t2.ind_principal=1,'active',''),'"><img src="modules/sistema/adjuntos/',t1.img_empresa,'"></div>'),''),t2.ind_principal
    FROM sys_empresa as t1, sys_usuario_empresa as t2
   WHERE t1.cod_empresa= t2.cod_empresa 
     AND t2.cod_usuario=codUsuario
GROUP BY t1.cod_empresa; 
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;
 OPEN imgEmpresa;
  imgEmpresaLoop: LOOP
  FETCH imgEmpresa INTO sImgEmp,indPpal;
   IF done THEN
    CLOSE imgEmpresa;
    LEAVE imgEmpresaLoop;
   END IF;
   IF sImgEmp <> '' THEN
    SET cCadImg = CONCAT(cCadImg,sImgEmp);
    SET cCabSli = CONCAT(cCabSli,'<li data-target="#myCarousel" data-slide-to="',cCiclo,'" ',IF(indPpal=1,' class="active"',''),'></li>');
    SET cCiclo = cCiclo + 1;
   END IF;
 END LOOP;
RETURN CONCAT('<ol class="carousel-indicators">',cCabSli,'</ol><div class="carousel-inner">',cCadImg,'</div>');
END$$

