                  WHEN '23' THEN CONCAT('<div class="col-lg-',t1.tam_campo,'">','<div style="width:100%" class="input-group" data-rel="span"><select id="',t1.det_campo,'" class="',IF(t1.ind_inputxs=1,'input-xs ',''),'selectFiltroAutocompleta" style="width:100%" name="',t1.det_campo,'[]" placeholder="',t1.holder_campo,'" ',CASE cMet WHEN 'N' THEN IF(t1.ind_habilita_nuevo=0,'disabled','') WHEN 'M' THEN IF(t1.ind_habilita_modifica=0,'disabled','') WHEN 'D' THEN IF(t1.ind_habilita_detalle=0,'disabled','') ELSE '' END,'><option>  </option>')
                  WHEN '24' THEN CONCAT('<div class="col-lg-',t1.tam_campo,'">','<div style="width:100%" class="input-group" data-rel="span"><select id="',t1.det_campo,'" class="',IF(t1.ind_inputxs=1,'input-xs ',''),'selectMultipleAutocompleta"  style="width:100%" multiple="multiple" name="',t1.det_campo,'[]" placeholder="',t1.holder_campo,'" ',CASE cMet WHEN 'N' THEN IF(t1.ind_habilita_nuevo=0,'disabled','') WHEN 'M' THEN IF(t1.ind_habilita_modifica=0,'disabled','') WHEN 'D' THEN IF(t1.ind_habilita_detalle=0,'disabled','') ELSE '' END,'><option>  </option>')
			    END
			ELSE 
             ''
		 END, t1.cod_tipoinput, t1.nom_tablaref,t2.ind_enlinea,t1.holder_campo,t1.tam_campo,t1.ind_actualiza 
   FROM sys_detframe as t1, sys_frame as t2 
  WHERE t1.cod_frame = codFrm
	AND t1.cod_frame = t2.cod_frame
ORDER BY t1.cod_indice;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done1 = TRUE;
 -- traemos la empresa del usuario conectado
 SET cCadenaEmp = fbTraeEmpresa(codUsu);
 -- abrimos el curor y armamos los input del formulario
 OPEN InputGroup;
 InputGroupLoop: LOOP
  FETCH InputGroup INTO cCadenaInputs, iTipoInput, cTablaRef,iIndLinea,cCadenaHolder,cCadenaTam,iIndActualiza; 
   IF done1 THEN
    CLOSE InputGroup;
    LEAVE InputGroupLoop;
   END IF;
-- selecciono el indicador de actualizable para agregar botones de actualizar y agregar en los combos que se requiera     
   IF iIndActualiza=1 THEN
    SET cMetNuevo     = (SELECT met_nuevo
		  				   FROM sys_tablareferencia 
		                  WHERE nom_referencia = trim(cTablaRef));                             
	SET cCadenaSpan = concat('<span class="input-group-btn"><button class="btn btn-success" type="button" id="btoAccion" data="',cTablaRef,'" data-rel="NUEVOREGISTRO" title="Crear Nuevo" data-url="',IF(cMetNuevo is not null,cMetNuevo,''),'"><i class="fa fa-plus"></i></button></span>
							  <span class="input-group-btn"><button class="btn btn-info" type="button" id="btoAccion" data="',cTablaRef,'" data-rel="ACTUALIZARCOMBO" title="Actualizar lista / Registros"><i class="fa fa-refresh"></i></button></span>');
   ELSEIF iIndActualiza=2 THEN
    SET cMetNuevo     = (SELECT met_nuevo
		  				   FROM sys_tablareferencia 
		                  WHERE nom_referencia = trim(cTablaRef));
    SET cCadenaSpan = concat('<span class="input-group-btn"><button class="btn btn-warning" type="button" id="btoAccion" data="',cTablaRef,'" data-rel="NUEVOREGISTRO" title="Crear Nuevo" data-url="',IF(cMetNuevo is not null,cMetNuevo,''),'"><i class="fa fa-plus"></i></button></span>');
   ELSEIF iIndActualiza =3 THEN
    SET cCadenaSpan = concat('<span class="input-group-btn"><button class="btn btn-error" type="button" id="btoAccion" data="" data-rel="CLONARINPUT" title="Agregar Fila" data-url=""><i class="fa fa-plus"></i></button></span>');		
   ELSE
	SET cCadenaSpan = '';
   END IF;
-- Tratamos los input de tipo select   
   CASE iTipoInput
    WHEN 1 THEN
     SET cCadenaInp = CONCAT(cCadenaInp, REPLACE(cCadenaInputs,'data-rel="span">',CONCAT('>',cCadenaSpan)),'</div>');
	WHEN 5 THEN
     SET cIniOption = fbArmaCombo(cTablaRef,codUsu,cCadenaEmp,cModulo);
	 SET cCadenaInp = CONCAT(cCadenaInp, REPLACE(cCadenaInputs,'data-rel="span">',CONCAT('>',cCadenaSpan)), cIniOption,'</select></div>', IF(iIndLinea=0,concat(cFinInput),'</div>'));
    WHEN 6 THEN
	 SET cIniOption = fbArmaCombo(cTablaRef,codUsu,cCadenaEmp,cModulo);
	 SET cCadenaInp = CONCAT(cCadenaInp, REPLACE(cCadenaInputs,'data-rel="span">',CONCAT('>',cCadenaSpan)), cIniOption,'</select></div>', IF(iIndLinea=0,concat(cFinInput),'</div>')) ;
	WHEN 7 THEN
	 SET cIniOption = fbArmaCombo(cTablaRef,codUsu,cCadenaEmp,cModulo);
	 SET cCadenaInp = CONCAT(cCadenaInp, REPLACE(cCadenaInputs,'data-rel="span">',CONCAT('>',cCadenaSpan)), cIniOption,'</select></div>', IF(iIndLinea=0,concat(cFinInput),'</div>'));
	WHEN 9 THEN
     SET cCadenaInp = CONCAT(cCadenaInp, REPLACE(cCadenaInputs,'data-rel="span">',CONCAT('>',cCadenaSpan)),'</div>');
    ELSE  
	 SET cCadenaInp = CONCAT(cCadenaInp, cCadenaInputs);
	END CASE;
-- agregamos una fila con nombres para las columnas para los formulario en linea    
	IF cCadenaHolder<>'' THEN
	 SET cCadenaLabel = CONCAT(cCadenaLabel,'<div class="col-lg-',cCadenaTam,'" style="text-align:center;">',cCadenaHolder,'</div>');
	END IF;
   END LOOP;
   IF iIndLinea=0 THEN
	RETURN cCadenaInp; 
   ELSEIF iIndLinea=1 THEN
	WHILE cCiclo > 0 DO
	 SET cCadenaCliclo = CONCAT(cCadenaCliclo, CONCAT('<div class="form-horizontal col-lg-12 clonar" data-nombre="div-Clon" data-indice="1" id="1"><div class="row" id="rowCopia">',REPLACE(REPLACE(REPLACE(cCadenaInp,'<option data-selected',concat('<option data-array=',cCiclo-1,' data-selected')), '[]" value=', concat('[]" data-array=',cCiclo-1,' value=')), '[]">', concat('[]" data-array=',cCiclo-1,'>')),'</div></div>'));
	 SET cCiclo = cCiclo - 1;
	END WHILE;
	RETURN CONCAT('<div class="col-sm-12" style="font-size:8pt;text-align:center;">',cCadenaLabel,'</div>',cCadenaCliclo);
   ELSE
    RETURN '';
   END IF;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaNotificacionTarea`(cCodEmpresa varchar(100), iCase int(1)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE done                    BOOL DEFAULT FALSE;
 DECLARE cCadenanNotificacion    longtext DEFAULT '';
 DECLARE cCadenanNotificacionFin longtext DEFAULT '';
 DECLARE Notificacion CURSOR FOR 
  SELECT CASE iCase
          WHEN 1 THEN
           CONCAT('<li><span class="padding-10 ',color_notificacion,'"><em class="badge padding-5 no-border-radius bg-color-blueLight pull-left margin-right-5"><i class="fa ',icon_notificacion,' fa-fw fa-2x"></i></em>',
                  '<span>',des_notificacion,'<br><span class="pull-right font-xs text-muted"><i>',fecha_notificacion,'</i></span></span></li>')
		  WHEN 2 THEN		
           CONCAT('<li><span class="padding-10 ',color_notificacion,'"><em class="badge padding-5 no-border-radius bg-color-blueLight pull-left margin-right-5"><i class="fa ',icon_notificacion,' fa-fw fa-2x"></i></em>',
                  '<span>',des_notificacion,'<br><span class="pull-right font-xs text-muted"><i>',fecha_notificacion,'</i></span></span></li>')
		 END
    FROM sys_notificacion 
   WHERE cod_empresa in(cCodEmpresa)
     AND ind_tarea= iCase 
     AND DATE(fecha_notificacion) BETWEEN date_add(DATE(NOW()), INTERVAL -5 DAY) 
                                      AND date_add(DATE(NOW()), INTERVAL +1 DAY) 
ORDER BY cod_notificacion DESC;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN Notificacion;
  NotificacionLoop: LOOP
  FETCH Notificacion INTO cCadenanNotificacion; 
   IF done THEN
    CLOSE Notificacion;
    LEAVE NotificacionLoop;
   END IF;
   set cCadenanNotificacionFin  = CONCAT(cCadenanNotificacionFin,cCadenanNotificacion); 
  END LOOP;
RETURN cCadenanNotificacionFin;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaSubCuenta`(cCadenaCuenta int(4)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE done  BOOL DEFAULT FALSE;
 DECLARE cCadenaNombre     longtext DEFAULT '';
 DECLARE cCadenaSubCuenta      INT(4);
 DECLARE cCadsubCuenta         longtext DEFAULT '';
 DECLARE subCuenta CURSOR FOR 
  SELECT concat(nom_cuenta,' - ',sub_cuenta), sub_cuenta
    FROM con_cuenta 
   WHERE cuenta_cuenta=cCadenaCuenta
     AND sub_cuenta>0 
ORDER BY sub_cuenta ASC;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN subCuenta;
  subCuentaLoop: LOOP
  FETCH subCuenta INTO cCadenaNombre,cCadenaCuenta; 
   IF done THEN
    CLOSE subCuenta;
    LEAVE subCuentaLoop;
   END IF;
   SET cCadsubCuenta=concat(cCadsubCuenta,'<li><span>', cCadenaNombre,'</span>','</li>'); 
  END LOOP;
RETURN concat('<ul>',cCadsubCuenta,'</ul>');
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaSubMenu`(codMenu int, codUsuario int) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE done BOOL DEFAULT FALSE;
 DECLARE sSubMenu varchar(10000);
 DECLARE cSubMenu longtext DEFAULT "";
 DECLARE subMenu CURSOR FOR 
   SELECT CONCAT('<li><a href="',fbArmaUrlBase64(t1.met_menu_sub,t1.cod_menu_sub,t1.ind_completa),
                 '" rel="tooltip" data-placement="right" data-original-title="',t1.des_menu_sub,'" data-html="true"><span class=""></span>',t1.nom_menu_sub,'
                    <i id="ind_header" data-header="',if(t1.ind_header=1,0,1),'" data-id="',t1.cod_menu_sub,'" class="pull-right text-align-left fa ',if(t1.ind_header=1,'fa-sort-desc','fa-sort-asc'),' fa-lg fa-2x',if(t1.ind_header=1,' blue',' blueDark'),'" data-icon="',t1.icon_menu_sub,'" data-color="',t1.bg_color,'" data-nombre="',t1.nom_menu_sub,'"></i>
				   </a>
				 </li>') as cadenaSubMenu 
     FROM sys_menu_sub as t1, sys_usuario_menu_sub as t2  
    WHERE t1.cod_menu     = codMenu    
      AND t2.cod_usuario  = codUsuario 
      AND t1.cod_menu_sub = t2.cod_menu_sub
      AND t1.ind_visible  = 1 
 GROUP BY t1.cod_menu_sub
 ORDER BY t1.cod_indice ASC;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;
 OPEN subMenu;
  subMenuLoop: LOOP
  FETCH subMenu INTO sSubMenu;
   IF done THEN
    CLOSE subMenu;
    LEAVE subMenuLoop;
   END IF;
   set cSubMenu = CONCAT(cSubMenu , sSubMenu);
  END LOOP;
RETURN cSubMenu;
END$$

