CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaTablaDesobturacion`(codConfigDental int(8), cCase int(1),cHistoriaClinica int(8)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE cCadenaTabla   longtext DEFAULT '';
 DECLARE cCadenaTabla_1 longtext DEFAULT '';
 DECLARE cCadenaTab     longtext DEFAULT '';
 DECLARE cCadenaTab_1   longtext DEFAULT '';
 DECLARE cCadenaInput   longtext DEFAULT '';
 DECLARE cCadenaInput_1 longtext DEFAULT '';
 DECLARE cCadenaEncab   longtext DEFAULT '';
 DECLARE cCadenaEncab_1 longtext DEFAULT '';
 DECLARE cCadenafinal   longtext DEFAULT '';
 DECLARE cIndCanal      int(1)   DEFAULT 0;
 DECLARE cIndLongitud   int(1)   DEFAULT 0;
 DECLARE cCodDiente     int(8)   DEFAULT 0;
 -- seleccionamos el codigo del diente
 SELECT cod_config_dental
   INTO cCodDiente
   FROM endodoncia_config_dental
  WHERE cod_imagen_dental=codConfigDental;
 -- seleccionamos los items de configuracion de nomenclatura
 SELECT ind_desobturacion_canal,ind_desobturacion_longitud
   INTO cIndCanal,cIndLongitud
   FROM endodoncia_config_nomenclatura
  WHERE cod_config_dental=cCodDiente;
 -- armamos la tabla segun parametrizacion
 IF cIndCanal=1 THEN
  SET cCadenaEncab = '<div class="col-lg-3">CANAL</div>';
  -- arammos las columnas con los espacion para los datos de lap
  SET cCadenaInput = (SELECT CONCAT(IF(ind_desobturacion_canal=1,CONCAT('<div class="col-lg-9"><input type="text" class="form-control" id="canal_desobturacion" name="noo_canal_desobturacion" placeholder="Canal" value="',IF(cCase=1,(select canal_desobturacion from endodoncia_historia_clinica_informacion_conductos where cod_historia_clinica=cHistoriaClinica),''),'"></div>'),'')) 
						FROM endodoncia_config_nomenclatura 
					   WHERE cod_config_dental=cCodDiente);                         
  SET cCadenaTabla = CONCAT('<div class="row" id="rowCopia">',cCadenaEncab,cCadenaInput,'</div>');											
 END IF;
 IF cIndLongitud=1 THEN
  SET cCadenaEncab_1 = CONCAT('<div class="col-lg-3">LONGITUD</div>');
  -- arammos las columnas con los espacion para los datos de longitud
  SET cCadenaInput_1 = (SELECT CONCAT(IF(ind_desobturacion_longitud=1,CONCAT('<div class="col-lg-9"><input type="text" class="form-control" id="long_desobturacion" name="noo_long_desobturacion" placeholder="Longitud" value="',IF(cCase=1,(select long_desobturacion from endodoncia_historia_clinica_informacion_conductos where cod_historia_clinica=cHistoriaClinica),''),'"></div>'),'')) 
						  FROM endodoncia_config_nomenclatura 
					     WHERE cod_config_dental=cCodDiente);                         
  SET cCadenaTabla_1 = CONCAT('<div class="row" id="rowCopia">',cCadenaEncab_1,cCadenaInput_1,'</div>');											                                           
 END IF;
 
 SET cCadenafinal = CONCAT('<div class="panel panel-default">
                             <div class="panel-heading">
							  <h4><span>Desobturacion</span></h4>
							 </div>
							 <div class="panel-body">
							  <div class="clonar form-group" data-nombre="div-Clon" data-indice="1" id="1">',cCadenaTabla,cCadenaTabla_1,'</div>
							 </div>
							</div>');
RETURN cCadenafinal;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaTablaDiagnostico`(codConfigDental int(8), cCase int(1),cHistoriaClinica int(8)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE cCadenaTabla   longtext DEFAULT '';
 DECLARE cCadenaTabla_1 longtext DEFAULT '';
 DECLARE cCadenaTabla_2 longtext DEFAULT '';
 DECLARE cCadenaTab     longtext DEFAULT '';
 DECLARE cCadenaTab_1   longtext DEFAULT '';
 DECLARE cCadenaTab_2   longtext DEFAULT '';
 DECLARE cCadenaInput   longtext DEFAULT '';
 DECLARE cCadenaInput_1 longtext DEFAULT '';
 DECLARE cCadenaInput_2 longtext DEFAULT '';
 DECLARE cCadenaEncab   longtext DEFAULT '';
 DECLARE cCadenaEncab_1 longtext DEFAULT '';
 DECLARE cCadenaEncab_2 longtext DEFAULT '';
 DECLARE cCadenaEnc     longtext DEFAULT '';
 DECLARE cCadenaEnc_1   longtext DEFAULT '';
 DECLARE cCadenaEnc_2   longtext DEFAULT '';
 DECLARE cCadenafinal   longtext DEFAULT '';
 DECLARE cIndLap        int(1)   DEFAULT 0;
 DECLARE cIndLongitud   int(1)   DEFAULT 0;
 DECLARE cIndConometria int(1)   DEFAULT 0;
 DECLARE cCodDiente     int(8)   DEFAULT 0;
 -- seleccionamos el codigo del diente
 SELECT cod_config_dental
   INTO cCodDiente
   FROM endodoncia_config_dental
  WHERE cod_imagen_dental=codConfigDental;
 -- seleccinamos los items de configuracion de nomenclatura
 SELECT ind_lap,ind_longitud,ind_conometria
   INTO cIndLap,cIndLongitud,cIndConometria
   FROM endodoncia_config_nomenclatura
  WHERE cod_config_dental=cCodDiente;
 -- armamos la tabla segun parametrizacion
 IF cIndLap=1 THEN
  SET cCadenaEncab = '<div class="col-lg-1">LAP</div>';
  -- armamos los encabezados de las columnas de la fila lap
  SET cCadenaEnc   = (SELECT CONCAT(IF(lap_d=1,'<div class="col-lg-1" style="text-align:center;">D</div>',''),
									IF(lap_p=1,'<div class="col-lg-1" style="text-align:center;">P</div>',''),
                                    IF(lap_m=1,'<div class="col-lg-1" style="text-align:center;">M</div>',''),
                                    IF(lap_v=1,'<div class="col-lg-1" style="text-align:center;">V</div>',''),
									IF(lap_ml=1,'<div class="col-lg-1" style="text-align:center;">M L</div>',''),
									IF(lap_mv=1,'<div class="col-lg-1" style="text-align:center;">M V</div>',''),
									IF(lap_dl=1,'<div class="col-lg-1" style="text-align:center;">D L</div>',''),
									IF(lap_dv=1,'<div class="col-lg-1" style="text-align:center;">D V</div>',''),
									IF(lap_mb=1,'<div class="col-lg-1" style="text-align:center;">MB2</div>',''),
									IF(lap_uni_conducto=1,'<div class="col-lg-1" style="text-align:center;">Uni Cond</div>',''),
                                    IF(lap_mm=1,'<div class="col-lg-1" style="text-align:center;">M M</div>','')) 
						FROM endodoncia_config_nomenclatura 
					   WHERE cod_config_dental=cCodDiente); 
  -- arammos las columnas con los espacion para los datos de lap
  SET cCadenaInput = (SELECT CONCAT(IF(lap_d=1,CONCAT('<div class="col-lg-1"><input type="text" class=" form-control" id="lap_d" name="noo_lap_d" data-array="0" placeholder="Distal" value="',IF(cCase=1,(select lap_d from endodoncia_historia_clinica_informacion_conductos where cod_historia_clinica=cHistoriaClinica),''),'"></div>'),''),
									IF(lap_p=1,CONCAT('<div class="col-lg-1"><input type="text" class=" form-control" id="lap_p" name="noo_lap_p" placeholder="Palatino" value="',IF(cCase=1,(select lap_p from endodoncia_historia_clinica_informacion_conductos where cod_historia_clinica=cHistoriaClinica),''),'"></div>'),''),
                                    IF(lap_m=1,CONCAT('<div class="col-lg-1"><input type="text" class=" form-control" id="lap_m" name="noo_lap_m" data-array="0" placeholder="Mesial" value="',IF(cCase=1,(select lap_m from endodoncia_historia_clinica_informacion_conductos where cod_historia_clinica=cHistoriaClinica),''),'"></div>'),''),
									IF(lap_v=1,CONCAT('<div class="col-lg-1"><input type="text" class=" form-control" id="lap_v" name="noo_lap_v" placeholder="Vestibular" value="',IF(cCase=1,(select lap_v from endodoncia_historia_clinica_informacion_conductos where cod_historia_clinica=cHistoriaClinica),''),'"></div>'),''),
