CREATE DEFINER=`root`@`localhost` FUNCTION `fbArmaUrlBase64`(cNomMetodo varchar(1000), cCodMenuSub int(8),ind_completa int(1)) RETURNS longtext CHARSET utf8
BEGIN
 DECLARE cUrl    LONGTEXT      DEFAULT '';
 DECLARE cVarApp VARCHAR(2000) DEFAULT '';
 DECLARE cVarMet VARCHAR(2000) DEFAULT '';
 DECLARE cVarArg VARCHAR(2000) DEFAULT '';
 SET cVarApp = fbBase64_encode(left(substring_index(cNomMetodo,'=',-3),
                              instr(substring_index(cNomMetodo,'=',-3),'&')-1));
 SET cVarMet = fbBase64_encode(left(substring_index(cNomMetodo,'=',-2),
                              instr(substring_index(cNomMetodo,'=',-2),'&')-1));	
 SET cVarArg = fbBase64_encode(concat(substring_index(cNomMetodo,'=',-1),IF(ind_completa=1,'*',''),IF(ind_completa=1,cCodMenuSub,''))); 
 SET cUrl = CONCAT('?app=',cVarApp,'&met=',cVarMet,'&arg=',cVarArg); 
RETURN cUrl;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbBase64_encode`(input blob) RETURNS blob
    DETERMINISTIC
    SQL SECURITY INVOKER
BEGIN
    DECLARE ret BLOB DEFAULT '';
    DECLARE done TINYINT DEFAULT 0;
    IF input IS NULL THEN
        RETURN NULL;
    END IF;
each_block:
    WHILE NOT done DO BEGIN
        DECLARE accum_value BIGINT UNSIGNED DEFAULT 0;
        DECLARE in_count TINYINT DEFAULT 0;
        DECLARE out_count TINYINT;
each_input_char:
        WHILE in_count < 3 DO BEGIN
            DECLARE first_char BLOB(1);

            IF LENGTH(input) = 0 THEN
                SET done = 1;
                SET accum_value = accum_value << (8 * (3 - in_count));
                LEAVE each_input_char;
            END IF;

            SET first_char = SUBSTRING(input,1,1);
            SET input = SUBSTRING(input,2);

            SET accum_value = (accum_value << 8) + ASCII(first_char);
            SET in_count = in_count + 1;
        END; END WHILE;
        CASE
            WHEN in_count = 3 THEN SET out_count = 4;
            WHEN in_count = 2 THEN SET out_count = 3;
            WHEN in_count = 1 THEN SET out_count = 2;
            ELSE RETURN ret;
        END CASE;

        WHILE out_count > 0 DO BEGIN
            BEGIN
                DECLARE out_char CHAR(1);
                DECLARE base64_getval CURSOR FOR SELECT c FROM sys_base64_data WHERE val = (accum_value >> 18);
                OPEN base64_getval;
                FETCH base64_getval INTO out_char;
                CLOSE base64_getval;
                SET ret = CONCAT(ret,out_char);
                SET out_count = out_count - 1;
                SET accum_value = accum_value << 6 & 0xffffff;
            END;
        END; END WHILE;
        CASE
            WHEN in_count = 2 THEN SET ret = CONCAT(ret,'=');
            WHEN in_count = 1 THEN SET ret = CONCAT(ret,'==');
            ELSE BEGIN END;
        END CASE;

    END; END WHILE;
    RETURN ret;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbDevuelveArchivos`(iNumForm int(8),iTipoArchivos int(1)) RETURNS longtext CHARSET utf8
BEGIN
 -- declaracion de variables necesarias para el proceso de la funcion
 DECLARE done         	 BOOL DEFAULT FALSE;
 DECLARE cArchivos    	 LONGTEXT DEFAULT '';
 DECLARE iCodArchivos 	 INT(8);
 DECLARE iCodIndice   	 INT(8);
 DECLARE cRuta        	 VARCHAR(10000);
 DECLARE cScript      	 LONGTEXT;
 DECLARE cObjeto      	 LONGTEXT;
 DECLARE cModApertura 	 VARCHAR(45);
 DECLARE cRef            VARCHAR(1000);
 DECLARE cCadenaCSS      LONGTEXT DEFAULT '';
 DECLARE cCadenaJS       LONGTEXT DEFAULT '';
 DECLARE cCadenaArchivo  LONGTEXT DEFAULT '';
 -- cursor para cargar todos los archivos
 DECLARE archivos CURSOR FOR 
  SELECT * 
    FROM (SELECT cod_archivos,cod_indice,ruta_archivos,script_archivos,objeto_archivos,modo_apertura_archivos,ref_archivos
            FROM sys_archivos
	       WHERE ind_defecto=1
           UNION 
          SELECT t2.cod_archivos,t2.cod_indice,t2.ruta_archivos,t2.script_archivos,t2.objeto_archivos,t2.modo_apertura_archivos as modo_apertura_archivos,t2.ref_archivos
            FROM sys_formulario_archivos as t1, sys_archivos as t2 
	       WHERE t1.cod_archivos = t2.cod_archivos
             AND t1.cod_formulario=iNumForm) a
ORDER BY modo_apertura_archivos, cod_indice; 
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 -- abro el cursor, lo recorro y concateno segun el modo de apertura
 OPEN archivos;
 archivosLoop: LOOP
  FETCH archivos INTO iCodArchivos, iCodIndice, cRuta, cScript, cObjeto, cModApertura, cRef;
   IF done THEN
    CLOSE archivos;
    LEAVE archivosLoop;
   END IF;
   CASE lower(cModApertura)
 -- cuando los archivos sean css
    WHEN 'href' THEN
	 SET cCadenaCSS = CONCAT(cCadenaCSS,'<link rel="stylesheet" ',IF(cRef IS NOT NULL,cRef,''),CONCAT(' href="',cRuta,'">'));
    WHEN 'src' THEN
 -- cuando los archivos son js
     SET cCadenaJS = CONCAT(cCadenaJS,IF(cObjeto IS NOT NULL,cObjeto,''),'<script ',IF(cRef IS NOT NULL,cRef,''),CONCAT(' src="',cRuta,'"></script>'),IF(cScript IS NOT NULL,cScript,''));
   END CASE;
  END LOOP;
  IF iTipoArchivos=1 THEN
   SET cCadenaArchivo = cCadenaCSS;
  ELSE
   SET cCadenaArchivo = cCadenaJS;
  END IF;
 -- Devuelvo la cadena concatenada
RETURN cCadenaArchivo;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbDevuelveDisponibilidad`(cCodGrupo int(8)) RETURNS int(11)
BEGIN
 DECLARE cDisponibilidad      int(4) DEFAULT 0;
 DECLARE cTotalGrupo          int(8) DEFAULT 0;
 DECLARE cTotalDisponibilidad int(8) DEFAULT 0;
 -- Obtenemos el numero de alumnos relacionados a el grupo
 SELECT COUNT(1)
   INTO cTotalGrupo
   FROM sined_alumno
  WHERE cod_grupo = cCodGrupo;
 -- Obtenemos el numero de disponibilidad del grupo
 SELECT nro_alumnos_grupo
   INTO cTotalDisponibilidad
   FROM sined_grupo
  WHERE cod_grupo=cCodGrupo;
 -- restamos y devolvemos el valor  
 SET cDisponibilidad=(cTotalDisponibilidad-cTotalGrupo);
RETURN cDisponibilidad;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbDevuelveEstado`(fecInicio DATE, fecFin DATE) RETURNS char(20) CHARSET utf8
BEGIN
 DECLARE cRespuesta     CHAR(20) DEFAULT 'info';
 IF fecInicio<DATE(NOW()) THEN
  SET cRespuesta=CONCAT('danger');
 END IF; 
 IF fecFin>DATE(NOW()) THEN
  SET cRespuesta=CONCAT('success');
 END IF;
RETURN cRespuesta;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbTraeCodResponsableSined`(codGru int(8),codMat int(8)) RETURNS int(8)
BEGIN
 DECLARE cCodResponsable int(8);
 SET cCodResponsable = (SELECT t2.cod_usuario 
                       FROM sined_carga_academica as t1, sys_usuario as t2 
					  WHERE t1.cod_grupo=codGru
                        AND t1.cod_materia =codMat
                        AND t1.bd_a_config =(SELECT bd_a_config
						                       FROM sined_config
						                      WHERE cod_estado='AAA')
	                    AND t1.cod_docente =t2.cod_usuario
				   GROUP BY t1.cod_grupo,t1.cod_materia);
RETURN cCodResponsable;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbTraeEmpresa`(codUsu int(8)) RETURNS char(100) CHARSET utf8
BEGIN
 DECLARE done  BOOL DEFAULT FALSE;
 DECLARE cCodEmp       varchar(8);
 DECLARE cCadenaEmp    CHAR(100) DEFAULT '';
 DECLARE Empresas CURSOR FOR 
  SELECT cod_empresa    
    FROM sys_usuario_empresa
   WHERE cod_usuario   = codUsu 
GROUP BY cod_empresa
ORDER BY cod_empresa DESC; 
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN Empresas;
  EmpresasLoop: LOOP
  FETCH Empresas INTO cCodEmp;
   IF done THEN
    CLOSE Empresas;
    LEAVE EmpresasLoop;
   END IF;
   set cCadenaEmp = CONCAT(cCadenaEmp,',',cCodEmp);
  END LOOP;
RETURN RIGHT(cCadenaEmp,(CHARACTER_LENGTH(cCadenaEmp)-1));
END$$

