GROUP BY cod_empresa
ORDER BY cod_empresa DESC; 
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 OPEN Empresas;
  EmpresasLoop: LOOP
  FETCH Empresas INTO cCodEmp;
   IF done THEN
    CLOSE Empresas;
    LEAVE EmpresasLoop;
   END IF;
   set cCadenaEmp = CONCAT(cCadenaEmp,',',cCodEmp);
  END LOOP;
RETURN CONCAT(cCadAlias,'.cod_empresa in(',RIGHT(cCadenaEmp,(CHARACTER_LENGTH(cCadenaEmp)-1)),')');
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbTraePromerioMateriaEstudiante`(`cCodEstudiante` INT(8), `cCodPeriodo` INT(8), `cCase` INT(1)) RETURNS float(8,4)
BEGIN
 DECLARE done  BOOL DEFAULT FALSE;
 DECLARE cNumMaterias FLOAT(8,4);
 DECLARE cGrupo       INT(8);
 DECLARE cNumPro1	  INT(3);
 DECLARE cPromedio    FLOAT(8,4) DEFAULT 0;
 DECLARE cPromedio1   FLOAT(8,4) DEFAULT 0;
 DECLARE PromedioEst CURSOR FOR 
  SELECT sum(cuantitativa_notas)/(SELECT count(1) 
                                    FROM sined_notas 
                                   WHERE cod_alumno=cCodEstudiante
									 AND cod_periodo_academico=cCodPeriodo)
	 FROM sined_notas 
	WHERE cod_periodo_academico=cCodPeriodo
      AND cod_materia not in(31,40,32)
      AND cod_grupo=(SELECT cod_grupo
                       FROM sined_alumno
					  WHERE cod_alumno=cCodEstudiante)
 GROUP BY cod_alumno;
 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done  = TRUE;
 CASE cCase
  WHEN 0 THEN 
   SELECT count(1) 
     INTO cNumMaterias
	 FROM sined_notas  
    WHERE cod_alumno            =cCodEstudiante
 	  AND cod_periodo_academico =cCodPeriodo
	  AND bd_a_config =(SELECT bd_a_config
							 FROM sined_config
						    WHERE cod_estado='AAA')
      AND cod_materia not in(31,40,32)                            
	  AND cualitativa_notas='SUPERIOR';
  WHEN 1 THEN 
   SELECT count(1) 
     INTO cNumMaterias
	 FROM sined_notas  
    WHERE cod_alumno            =cCodEstudiante
 	  AND cod_periodo_academico =cCodPeriodo
	  AND bd_a_config =(SELECT bd_a_config
							 FROM sined_config
						    WHERE cod_estado='AAA')
      AND cod_materia not in(31,40,32)
	  AND cualitativa_notas='ALTO';
  WHEN 2 THEN 
   SELECT count(1) 
     INTO cNumMaterias
	 FROM sined_notas  
    WHERE cod_alumno            =cCodEstudiante
 	  AND cod_periodo_academico =cCodPeriodo
	  AND bd_a_config =(SELECT bd_a_config
							 FROM sined_config
						    WHERE cod_estado='AAA')
	  AND cod_materia not in(31,40,32)
	  AND cualitativa_notas='BASICO';
  WHEN 3 THEN 
   SELECT count(1) 
     INTO cNumMaterias
	 FROM sined_notas  
    WHERE cod_alumno            =cCodEstudiante
 	  AND cod_periodo_academico =cCodPeriodo
	  AND bd_a_config =(SELECT bd_a_config
							 FROM sined_config
						    WHERE cod_estado='AAA')
	  AND cod_materia not in(31,40,32)
	  AND cualitativa_notas='BAJO';
  WHEN 4 THEN 
   SELECT count(1) 
     INTO cNumPro1
     FROM sined_notas 
	WHERE cod_alumno=cCodEstudiante 
      AND cod_periodo_academico=cCodPeriodo
	  AND bd_a_config =(SELECT bd_a_config
						  FROM sined_config
						 WHERE cod_estado='AAA')
	  AND cod_materia not in(31,40,32);
   SELECT FORMAT(SUM(cuantitativa_notas)/cNumPro1,1) 
     INTO cNumMaterias
	 FROM sined_notas 
	WHERE cod_alumno=cCodEstudiante 
      AND cod_periodo_academico=cCodPeriodo
      AND cod_materia not in(31,40,32);
  WHEN 5 THEN 
   SELECT cod_grupo 
     INTO cGrupo
     FROM sined_alumno 
	WHERE cod_alumno=cCodEstudiante
      AND bd_a_config =(SELECT bd_a_config
						  FROM sined_config
						 WHERE cod_estado='AAA'); 
   SELECT count(1) 
     INTO cNumPro1
     FROM sined_alumno 
	WHERE cod_grupo=cGrupo 
	  AND bd_a_config =(SELECT bd_a_config
						  FROM sined_config
						 WHERE cod_estado='AAA');
   
   OPEN PromedioEst;
    PromedioEstLoop: LOOP
    FETCH PromedioEst INTO cPromedio1; 
     IF done THEN
      CLOSE PromedioEst;
      LEAVE PromedioEstLoop;
     END IF;
     set cPromedio  = (cPromedio+cPromedio1); 
    END LOOP;
   SET cNumMaterias= cPromedio/cNumPro1;
 WHEN 6 THEN 
   SELECT count(1) 
     INTO cNumPro1
     FROM sined_notas 
	WHERE cod_alumno=cCodEstudiante 
      AND cod_periodo_academico=cCodPeriodo
	  AND bd_a_config =(SELECT bd_a_config
						  FROM sined_config
						 WHERE cod_estado='AAA')
	  AND cod_materia not in(31,40,32);
   SELECT FORMAT(SUM(com_soc_notas)/cNumPro1,1) 
     INTO cNumMaterias
	 FROM sined_notas 
	WHERE cod_alumno=cCodEstudiante 
      AND cod_periodo_academico=cCodPeriodo
      AND cod_materia not in(31,40,32);
 WHEN 7 THEN 
   SELECT SUM(fall_inj_notas) 
     INTO cNumMaterias
     FROM sined_notas 
	WHERE cod_alumno=cCodEstudiante 
      AND cod_periodo_academico=cCodPeriodo
	  AND bd_a_config =(SELECT bd_a_config
						  FROM sined_config
						 WHERE cod_estado='AAA')
	  AND cod_materia not in(31,40,32);
  WHEN 8 THEN 
   SELECT FORMAT(cuantitativa_notas,1) 
     INTO cNumMaterias
	 FROM sined_notas 
	WHERE cod_alumno=cCodEstudiante 
      AND cod_periodo_academico=cCodPeriodo
      AND cod_materia=31;
 END CASE;
RETURN cNumMaterias;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fbTraeResponsableSined`(codGru int(8),codMat int(8)) RETURNS char(200) CHARSET utf8
BEGIN
 DECLARE cResponsable longtext DEFAULT '';
 SET cResponsable = (SELECT CONCAT(t2.nom_usuario,' ',t2.ape_usuario)
                       FROM sined_carga_academica as t1, sys_usuario as t2 
					  WHERE t1.cod_grupo=codGru
                        AND t1.cod_materia =codMat
                        AND t1.bd_a_config =(SELECT bd_a_config
						                       FROM sined_config
						                      WHERE cod_estado='AAA')
	                    AND t1.cod_docente =t2.cod_usuario
				   GROUP BY t1.cod_grupo,t1.cod_materia);
RETURN cResponsable;
END$$

