--


--
-- Disparadores `crm_gestion`
--
DROP TRIGGER IF EXISTS `crm_gestion_AFTER_INSERT`;
DELIMITER //
CREATE TRIGGER `crm_gestion_AFTER_INSERT` AFTER INSERT ON `crm_gestion`
 FOR EACH ROW BEGIN
 -- si el estado es cerrado se actualizan las demas tablas para normalizar
 IF new.cod_estado='CCC' THEN
 -- cierro las asignaciones abiertas a este contacto
  UPDATE crm_bandeja_asignacion
     SET cod_estado='BBB',
          fec_mod_bandeja_asignacion=now()
   WHERE cod_contacto=new.cod_contacto;
 -- actualizo el indicador de facturable para que se pueda generar la factura
  UPDATE fa_cliente
     SET ind_facturacion=1
   WHERE cod_cliente=(SELECT cod_cliente
                        FROM crm_contacto
                       WHERE cod_contacto=new.cod_contacto);
-- actualizo los datos del contacto con los nuevos datos segun la gestion
 UPDATE crm_contacto 
    SET cod_estado=new.cod_estado,fec_prox_contacto=new.fec_prox_contacto,
        fec_mod_contacto=new.fec_gestion
  WHERE cod_contacto=new.cod_contacto;                       
 ELSE
 -- actualizo los datos del contacto con los nuevos datos segun la gestion
 UPDATE crm_contacto 
    SET cod_estado=new.cod_estado,fec_prox_contacto=new.fec_prox_contacto,
        fec_mod_contacto=new.fec_gestion,fec_programada_contacto=new.fec_programada_gestion
  WHERE cod_contacto=new.cod_contacto;
 -- si el usuario de asignacion es diferente al actual se inserta una nueva asignacion y se cierra la actual
  IF new.cod_usuario_asignado<>new.cod_usuario THEN
   UPDATE crm_bandeja_asignacion
      SET cod_estado='BBB',
          fec_mod_bandeja_asignacion=now()
	WHERE cod_contacto=new.cod_contacto;
	    VALUES (new.cod_usuario_asignado,new.cod_contacto,now(),new.cod_usuario,'AAA');
  END IF;
 -- actualizo la fecha de gestion en la bandeja
  UPDATE crm_bandeja_asignacion
	 SET fec_mod_bandeja_asignacion=now()
   WHERE cod_contacto=new.cod_contacto;
 END IF;
END
//
DELIMITER ;

