--


--
-- Disparadores `crm_productos_usuario`
--
DROP TRIGGER IF EXISTS `crm_productos_usuario_BEFORE_DELETE`;
DELIMITER //
CREATE TRIGGER `crm_productos_usuario_BEFORE_DELETE` BEFORE DELETE ON `crm_productos_usuario`
 FOR EACH ROW BEGIN
 DECLARE cNomUsuario VARCHAR(500) DEFAULT '';
 -- selecciono el nombre del usuario para buscar si existen medios asociados a este
 SELECT CONCAT(nom_usuario,' ',ape_usuario)
   INTO cNomUsuario
   FROM sys_usuario
  WHERE cod_usuario = old.cod_usuario;
 -- borramos los medios relacionados al usuario
 DELETE 
   FROM crm_medios 
  WHERE cod_productos=old.cod_productos
    AND nom_medios=cNomUsuario;   
END
//
DELIMITER ;
DROP TRIGGER IF EXISTS `crm_productos_usuario_BEFORE_INSERT`;
DELIMITER //
CREATE TRIGGER `crm_productos_usuario_BEFORE_INSERT` BEFORE INSERT ON `crm_productos_usuario`
 FOR EACH ROW BEGIN
 DECLARE cIndApp    INT(1)       DEFAULT 0;
 DECLARE cNomMedios VARCHAR(500) DEFAULT '';
 DECLARE cCodEmp    INT(8)       DEFAULT 0;
 DECLARE cSecuencia INT(8)       DEFAULT 0;
 DECLARE iMedio     int(8)       DEFAULT 0;
 SELECT ind_app,CONCAT(nom_usuario,' ',ape_usuario)
   INTO cIndApp,cNomMedios 
   FROM sys_usuario
  WHERE cod_usuario=new.cod_usuario;
 SELECT cod_empresa
   INTO cCodEmp
   FROM crm_productos
  WHERE cod_productos=new.cod_productos;
 SELECT count(1)
   INTO iMedio
   FROM crm_medios
  WHERE nom_medios=cNomMedios
    AND cod_productos=new.cod_productos;
 IF cIndApp=1 AND iMedio=0 THEN
  SET cSecuencia = (SELECT IF(MAX(cod_medios) IS NOT NULL,MAX(cod_medios) + 1,1)
					  FROM crm_medios);
	   VALUES (cSecuencia,cNomMedios,cNomMedios,now(),new.cod_usuario,cCodEmp,'AAA',new.cod_productos,1);
 END IF;
END
//
DELIMITER ;

