  `cod_gestion` int(11) NOT NULL AUTO_INCREMENT,
  `obs_gestion` varchar(20000) DEFAULT NULL,
  `fec_gestion` datetime DEFAULT NULL,
  `fec_prox_voto` date DEFAULT NULL,
  `fec_programada_gestion` datetime DEFAULT NULL,
  `cod_voto` int(8) DEFAULT NULL,
  `cod_usuario` int(8) DEFAULT NULL,
  `cod_estado` varchar(3) DEFAULT NULL,
  `cod_usuario_asignado` int(8) DEFAULT NULL,
  PRIMARY KEY (`cod_gestion`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='TABLA PARA ALMACENAR LAS GESTIONES DE LOS VOTOS' AUTO_INCREMENT=1 ;

--
-- Disparadores `datolee_gestion`
--
DROP TRIGGER IF EXISTS `datolee_gestion_AFTER_INSERT`;
DELIMITER //
CREATE TRIGGER `datolee_gestion_AFTER_INSERT` AFTER INSERT ON `datolee_gestion`
 FOR EACH ROW BEGIN
  -- si el estado es cerrado se actualizan las demas tablas para normalizar
 IF new.cod_estado='CCC' THEN
 -- cierro las asignaciones abiertas a este contacto
  UPDATE datolee_bandeja_voto
     SET cod_estado='BBB',
		 fec_mod_bandeja_voto=now()
   WHERE cod_voto=new.cod_voto;
-- actualizo los datos del contacto con los nuevos datos segun la gestion
 UPDATE datolee_voto
    SET cod_estado=new.cod_estado,fec_prox_voto=new.fec_prox_voto,
        fec_mod_voto=new.fec_gestion
  WHERE cod_voto=new.cod_voto;                       
 ELSE
 -- actualizo los datos del contacto con los nuevos datos segun la gestion
 UPDATE datolee_voto
    SET cod_estado=new.cod_estado,fec_prox_voto=new.fec_prox_voto,
        fec_mod_voto=new.fec_gestion 
  WHERE cod_voto=new.cod_voto;
 -- si el usuario de asignacion es diferente al actual se inserta una nueva asignacion y se cierra la actual
  IF new.cod_usuario_asignado<>new.cod_usuario THEN
   UPDATE datolee_bandeja_voto
      SET cod_estado='BBB',
          fec_mod_bandeja_voto=now()
	WHERE cod_voto=new.cod_voto;
	    VALUES (new.cod_usuario_asignado,new.cod_voto,now(),new.cod_usuario,'AAA');
  END IF;
 -- actualizo la fecha de gestion en la bandeja
  UPDATE datolee_bandeja_voto
	 SET fec_mod_bandeja_voto=now()
   WHERE cod_voto=new.cod_voto;
 END IF;
END
//
DELIMITER ;

