--
-- Disparadores `datolee_sublider`
--
DROP TRIGGER IF EXISTS `datolee_sublider_BEFORE_DELETE`;
DELIMITER //
CREATE TRIGGER `datolee_sublider_BEFORE_DELETE` BEFORE DELETE ON `datolee_sublider`
 FOR EACH ROW BEGIN
 -- borramos los perfiles relacionados
 DELETE FROM sys_usuario WHERE cod_usuario=old.cod_sublider;
END
//
DELIMITER ;
DROP TRIGGER IF EXISTS `datolee_sublider_BEFORE_INSERT`;
DELIMITER //
CREATE TRIGGER `datolee_sublider_BEFORE_INSERT` BEFORE INSERT ON `datolee_sublider`
 FOR EACH ROW BEGIN
 DECLARE cCodUsuario  INT(8) DEFAULT 0;
 DECLARE cCodEmp      INT(8);
 -- recupero el maximo valor para asingar a la primary key
 SELECT (MAX(cod_usuario)+1)
   INTO cCodUsuario 
   FROM sys_usuario;
 -- seteamos el cod_sublider con el codigo de la tabla usuario asignado para evitar conflicto de datos
 SET new.cod_sublider = cCodUsuario;
 -- insertamos al sublider en la tabla de usuarios para permitir el logueo en la app
	  VALUES (cCodUsuario,new.nom_sublider,new.ape_sublider,new.dir_sublider,new.tel_sublider,now(),new.usuario_sublider,new.password_sublider,new.cod_estado,1);
 -- Asignamos las empresas al usuario segun las aignadas al lider
	  VALUES (cCodUsuario,new.cod_empresa);      
 -- insertamos el perfil para el sublider
      VALUES (cCodUsuario,3);      
END
//
DELIMITER ;

