--
-- Disparadores `endodoncia_historia_clinica`
--
DROP TRIGGER IF EXISTS `endodoncia_historia_clinica_AFTER_INSERT`;
DELIMITER //
CREATE TRIGGER `endodoncia_historia_clinica_AFTER_INSERT` AFTER INSERT ON `endodoncia_historia_clinica`
 FOR EACH ROW BEGIN
 DECLARE cMes int(3);
 DECLARE cFecha datetime;
-- control de tiempos de control medico 
 IF new.cod_config_control<>0 THEN
  SELECT mes_config_control
	INTO cMes
    FROM endodoncia_config_control
   WHERE cod_config_control = new.cod_config_control;
  SET cFecha = date_add(date_add(new.fec_historia_clinica, INTERVAL cMes MONTH), INTERVAL -5 DAY);
  call pbNuevaNotificacionTarea(new.cod_paciente, new.cod_empresa, new.cod_usuario, 4, CAST(date_add(new.fec_historia_clinica, INTERVAL cMes MONTH) AS CHAR), cFecha, @cDesError, @cNumError);
 END IF;
-- control de tiempos de pago 
 IF date(new.fec_prox_pago)<>date('0000-00-00') THEN
  SET cFecha = date_add(new.fec_prox_pago, INTERVAL -5 DAY);
  call pbNuevaNotificacionTarea(new.cod_paciente, new.cod_empresa, new.cod_usuario, 5, CAST(new.fec_prox_pago AS CHAR), cFecha, @cDesError, @cNumError);
 END IF;
END
//
DELIMITER ;

