  `cod_pago_detalle` int(8) NOT NULL AUTO_INCREMENT,
  `cod_pago` int(8) DEFAULT NULL,
  `cod_historia_clinica` int(8) DEFAULT NULL,
  `con_pago_detalle` varchar(10000) DEFAULT NULL COMMENT 'concepto o descripcion del gasto ',
  `imp_pago_detalle` float(20,4) DEFAULT NULL,
  PRIMARY KEY (`cod_pago_detalle`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1 COMMENT='TABLA PARA GUARDAR EL DETALLE DEL COMPROBANTE DE PAGO' AUTO_INCREMENT=104 ;

--
-- Volcado de datos para la tabla `endodoncia_pago_detalle`
--


--
-- Disparadores `endodoncia_pago_detalle`
--
DROP TRIGGER IF EXISTS `endodoncia_pago_detalle_BEFORE_INSERT`;
DELIMITER //
CREATE TRIGGER `endodoncia_pago_detalle_BEFORE_INSERT` BEFORE INSERT ON `endodoncia_pago_detalle`
 FOR EACH ROW BEGIN
 DECLARE iValosAdeu FLOAT(20,4) DEFAULT '0,00';
 DECLARE iValosCanc FLOAT(20,4) DEFAULT '0,00';
 SET iValosAdeu = IFNULL((SELECT imp_adeu_historia_clinica FROM endodoncia_historia_clinica WHERE cod_historia_clinica=new.cod_historia_clinica),0) - new.imp_pago_detalle;
 SET iValosCanc = IFNULL((SELECT imp_canc_historia_clinica FROM endodoncia_historia_clinica WHERE cod_historia_clinica=new.cod_historia_clinica),0) + new.imp_pago_detalle;
 UPDATE endodoncia_historia_clinica
    SET imp_adeu_historia_clinica=iValosAdeu,  
        imp_canc_historia_clinica=iValosCanc 
  WHERE cod_historia_clinica=new.cod_historia_clinica;
-- actualizo la tabla de pago con la nueva cifra incluido el abono
 UPDATE endodoncia_pago
    SET imp_adeu_pago=iValosAdeu
  WHERE cod_pago=new.cod_pago;
END
//
DELIMITER ;

