--
-- Disparadores `fa_cliente`
--
DROP TRIGGER IF EXISTS `fa_cliente_BEFORE_DELETE`;
DELIMITER //
CREATE TRIGGER `fa_cliente_BEFORE_DELETE` BEFORE DELETE ON `fa_cliente`
 FOR EACH ROW BEGIN
 -- borramos las contactos a este cliente para normalizar
 DELETE FROM crm_contacto WHERE cod_cliente=old.cod_cliente;
 -- enviamos el clente al historial para recuperarlos posteriomente
              obs_cliente,fec_cliente,fec_hist_cliente,cod_ciudad,cod_tipopago,cod_empresa,cod_usuario,cod_estado,ind_facturacion)
	  VALUES (old.nom_cliente,old.nit_cliente,old.dir_cliente,old.email_cliente,old.tel_cliente,old.tel1_cliente,old.fax_cliente,old.cel_cliente,old.ind_cliente_cliente,old.ind_proveedor_cliente,
              old.obs_cliente,old.fec_cliente,now(),old.cod_ciudad,old.cod_tipopago,old.cod_empresa,old.cod_usuario,old.cod_estado,0);       
END
//
DELIMITER ;

