  `cod_retencion` int(8) DEFAULT NULL,
  `imp_retencion` float(16,2) DEFAULT '0.00',
  `cod_impuesto` int(8) DEFAULT NULL,
  `imp_impuesto` float(16,2) DEFAULT '0.00',
  `cod_pago` int(8) DEFAULT NULL,
