--
-- Volcado de datos para la tabla `fa_detpago`
--


--
-- Disparadores `fa_detpago`
--
DROP TRIGGER IF EXISTS `fa_detpago_BINS`;
DELIMITER //
CREATE TRIGGER `fa_detpago_BINS` BEFORE INSERT ON `fa_detpago`
 FOR EACH ROW BEGIN 
 DECLARE cImpAdeudado int(40);
 DECLARE cImpCancelado int(40);
 DECLARE cEstado varchar(3) DEFAULT 'FAA'; 
 IF NEW.cod_factura<>'' THEN
   UPDATE fa_pago 
	  SET cod_factura=new.cod_factura
    WHERE cod_pago=NEW.cod_pago;
   SELECT (imp_adeudado - NEW.imp_detpago),(imp_cancelado + NEW.imp_detpago)
     INTO cImpAdeudado,cImpCancelado
     FROM fa_factura
    WHERE cod_factura=NEW.cod_factura;
   IF cImpAdeudado=0 THEN
    set cEstado='FBB';
   END IF;
   UPDATE fa_factura
      SET imp_cancelado=cImpCancelado,ind_comprobante=1,imp_adeudado=cImpAdeudado,cod_estado=cEstado,fec_modifica=now()
    WHERE cod_factura=NEW.cod_factura;
  ELSEIF NEW.cod_categoria<>'' THEN
   UPDATE fa_pago 
	  SET cod_categoria=new.cod_categoria
    WHERE cod_pago=NEW.cod_pago;
  END IF;
 END
//
DELIMITER ;

