--


--
-- Disparadores `fa_pago`
--
DROP TRIGGER IF EXISTS `fa_pago_BINS`;
DELIMITER //
CREATE TRIGGER `fa_pago_BINS` BEFORE INSERT ON `fa_pago`
 FOR EACH ROW BEGIN 
 DECLARE cCompIngreso int(20);
 DECLARE cCompEgreso int(20);
 SELECT (num_sig_comp_ingreso+1),(num_sig_comp_egreso+1)
   INTO cCompIngreso,cCompEgreso
   FROM fa_config
  WHERE cod_estado='AAA'
    AND cod_empresa= new.cod_empresa;
 IF NEW.ind_ingreso=1 THEN
   UPDATE fa_config 
	  SET num_sig_comp_ingreso=cCompIngreso
    WHERE cod_estado='AAA'
      AND cod_empresa= new.cod_empresa;
 ELSEIF NEW.ind_egreso=1 then
   UPDATE fa_config 
	  SET num_sig_comp_egreso=cCompEgreso
    WHERE cod_estado='AAA'
      AND cod_empresa= new.cod_empresa;
 END IF;
END
//
DELIMITER ;

