--
-- Disparadores `hd_gestion`
--
DROP TRIGGER IF EXISTS `hd_gestion_BEFORE_INSERT`;
DELIMITER //
CREATE TRIGGER `hd_gestion_BEFORE_INSERT` BEFORE INSERT ON `hd_gestion`
 FOR EACH ROW BEGIN
  SET new.total_tiempo_gestion= SEC_TO_TIME(TIMESTAMPDIFF(SECOND, cast(concat(date(now()),' ',cast(new.hora_inicio as time)) as datetime), 
																  cast(concat(date(now()),' ',cast(new.hora_fin as time))    as datetime))); 
END
//
DELIMITER ;

