--
-- Disparadores `hd_servicio`
--
DROP TRIGGER IF EXISTS `hd_servicio_BEIN`;
DELIMITER //
CREATE TRIGGER `hd_servicio_BEIN` BEFORE INSERT ON `hd_servicio`
 FOR EACH ROW BEGIN
 DECLARE cDiasDuracion int(3) DEFAULT 0;
 SELECT dias_resolucion_prioridad
   INTO cDiasDuracion
   FROM hd_prioridad
  WHERE cod_prioridad   =new.cod_prioridad;
 SET new.fec_servicio   =now();
 SET new.fec_vencimiento=DATE_ADD(now(), INTERVAL cDiasDuracion DAY);
END
//
DELIMITER ;
DROP TRIGGER IF EXISTS `hd_servicio_BEUP`;
DELIMITER //
CREATE TRIGGER `hd_servicio_BEUP` BEFORE UPDATE ON `hd_servicio`
 FOR EACH ROW BEGIN
 DECLARE cDiasDuracion int(3) DEFAULT 0;
 DECLARE cCodUltimaGestion int(8) DEFAULT 0;
 SELECT dias_resolucion_prioridad
   INTO cDiasDuracion
   FROM hd_prioridad
  WHERE cod_prioridad   =new.cod_prioridad;
  SET new.fec_vencimiento=DATE_ADD(new.fec_servicio, INTERVAL cDiasDuracion DAY);
 IF new.cod_estado='SCC' THEN
  SELECT t2.cod_gestion
    INTO cCodUltimaGestion
    FROM hd_asignacion as t1, hd_gestion as t2 
   WHERE t1.cod_servicio=new.cod_servicio
     AND t1.cod_asignacion=t2.cod_asignacion
ORDER BY cod_gestion DESC LIMIT 1;
  SET new.cod_ultima_gestion=cCodUltimaGestion;
 END IF;
END
//
DELIMITER ;

