--
-- Disparadores `sined_alumno`
--
DROP TRIGGER IF EXISTS `sined_alumno_BEIN`;
DELIMITER //
CREATE TRIGGER `sined_alumno_BEIN` BEFORE INSERT ON `sined_alumno`
 FOR EACH ROW BEGIN 
  DECLARE cDesGrupo VARCHAR(200) DEFAULT '';
  SET new.bd_a_config = (SELECT bd_a_config
                           FROM sined_config
						  WHERE cod_estado='AAA');
-- inserto el alumno y el grupo en el historial cuando este matriculado de los contrario inserto la novedad de preinscripcion
 IF new.cod_grupo<>'' THEN 
	   VALUES (new.cod_alumno,new.cod_grupo,new.fec_alumno,new.bd_a_config);
-- seleccionamos el grupo para el historial
  SELECT nom_grupo 
	INTO cDesGrupo
    FROM sined_grupo
   WHERE cod_grupo = new.cod_grupo;
-- inserto la novedad en el historial de novedades
	   VALUES (new.cod_alumno,CONCAT('La matricula se efectuo correctamente - Grupo / Ciclo: ', cDesGrupo, ' Fecha de Matricula: ',new.fec_alumno,IF(new.obs_alumno<>'',CONCAT(' Observaciones / Consideraciones: ',new.obs_alumno),'')),now(),new.cod_usuario);
 ELSE
  -- inserto la novedad en el historial de novedades
	   VALUES (new.cod_alumno,CONCAT('La preinscripcion se efectuo correctamente, recuerde completar los datos de grupo, codigo simat y consideraciones para la matricula, Fecha de Preinscripcion: ',new.fec_alumno,IF(new.obs_alumno<>'',CONCAT(' Observaciones / Consideraciones: ',new.obs_alumno),'')),now(),new.cod_usuario);
 END IF;
END
//
DELIMITER ;
DROP TRIGGER IF EXISTS `sined_alumno_BEUP`;
DELIMITER //
CREATE TRIGGER `sined_alumno_BEUP` BEFORE UPDATE ON `sined_alumno`
 FOR EACH ROW BEGIN
 DECLARE cDesGrupo    VARCHAR(200) DEFAULT '';
 DECLARE cDesNovedad  VARCHAR(2000) DEFAULT '';
 -- inserto la novedad y demas acciones segun el case y el codigo de tipo de novedad
 IF new.cod_tipo_novedad<>'' Or new.cod_tipo_novedad is not null THEN
 -- selecciono el tipo de novedad
  SELECT des_tipo_novedad
	INTO cDesNovedad
	FROM sys_tipo_novedad
   WHERE cod_tipo_novedad=new.cod_tipo_novedad;
  CASE new.cod_tipo_novedad
   WHEN 5 THEN 
	      VALUE (new.cod_alumno,new.cod_grupo,new.fec_alumno,new.fec_mod_alumno,new.bd_a_config);
    SELECT nom_grupo 
   	  INTO cDesGrupo
      FROM sined_grupo
     WHERE cod_grupo = new.cod_grupo;
-- inserto la novedad en el historial de novedades
	     VALUES (new.cod_alumno,CONCAT('El cambio de grupo se efectuo correctamente - Grupo / Ciclo: ', cDesGrupo, ' Fecha de Matricula: ',new.fec_alumno,IF(new.obs_alumno<>'',CONCAT(' Observaciones / Consideraciones: ',new.obs_alumno),''),' - Tipo de novedad: ',cDesNovedad),now(),new.cod_usuario);
   WHEN 6 THEN
-- inserto la novedad en el historial de novedades
	     VALUES (new.cod_alumno,CONCAT('El cambio de estado se efectuo correctamente - Tipo de novedad: ',cDesNovedad,IF(new.obs_alumno<>'',CONCAT(' Observaciones / Consideraciones: ',new.obs_alumno),'')),now(),new.cod_usuario);
   WHEN 8 THEN
-- inserto la novedad en el historial de novedades
	     VALUES (new.cod_alumno,CONCAT('El cambio de estado y cambio de grupo se efectuaron correctamente - Tipo de novedad: ',cDesNovedad,IF(new.obs_alumno<>'',CONCAT(' Observaciones / Consideraciones: ',new.obs_alumno),'')),now(),new.cod_usuario);  
   WHEN 1 THEN
-- inserto la novedad en el historial de novedades
	     VALUES (new.cod_alumno,CONCAT('La edicion se efectuo correctamente - Tipo de novedad: ',cDesNovedad,IF(new.obs_alumno<>'',CONCAT(' Observaciones / Consideraciones: ',new.obs_alumno),'')),now(),new.cod_usuario); 
   WHEN 10 THEN
-- inserto el alumno y el grupo en el historial cuando este matriculado    
	   VALUES (new.cod_alumno,new.cod_grupo,new.fec_alumno,new.bd_a_config);
-- seleccionamos el grupo para el historial
    SELECT nom_grupo 
	  INTO cDesGrupo
      FROM sined_grupo
     WHERE cod_grupo = new.cod_grupo;
-- inserto la novedad en el historial de novedades
	     VALUES (new.cod_alumno,CONCAT('La matricula se efectuo correctamente - Grupo / Ciclo: ', cDesGrupo, ' Fecha de Matricula: ',new.fec_alumno,IF(new.obs_alumno<>'',CONCAT(' Observaciones / Consideraciones: ',new.obs_alumno),'')),now(),new.cod_usuario);
  END CASE;
 END IF;  
END
//
DELIMITER ;

