DROP TRIGGER IF EXISTS `sined_carga_academica_BEIN`;
DELIMITER //
CREATE TRIGGER `sined_carga_academica_BEIN` BEFORE INSERT ON `sined_carga_academica`
 FOR EACH ROW BEGIN 
  set new.cod_empresa = fbTraeEmpresa(new.cod_usuario);
  set new.cod_estado  = 'AAA';
  SET new.bd_a_config = (SELECT bd_a_config
                           FROM sined_config
						  WHERE cod_estado='AAA');
  SET new.fec_carga_academica = now();						
END
//
DELIMITER ;
DROP TRIGGER IF EXISTS `sined_carga_academica_BEUP`;
DELIMITER //
CREATE TRIGGER `sined_carga_academica_BEUP` BEFORE UPDATE ON `sined_carga_academica`
 FOR EACH ROW BEGIN
 SET new.fec_mod_carga_academica = now();	
END
//
DELIMITER ;

