 SET new.bd_a_config       = (SELECT bd_a_config
						        FROM sined_config
							   WHERE cod_estado='AAA');
 -- Se carga el campo de la fecha de registro                               
 SET new.fec_notas         = now();	
 -- Se carga el campo de la nota cualitativa
 SET new.cualitativa_notas = (SELECT cualitativa_nota_equivalencia 
						        FROM sined_nota_equivalencia
						       WHERE new.cuantitativa_notas BETWEEN ini_nota_equivalencia 
                                                                AND fin_nota_equivalencia);
END
