--
-- Disparadores `sys_detframe`
--
DROP TRIGGER IF EXISTS `sys_detframe_BEIN`;
DELIMITER //
CREATE TRIGGER `sys_detframe_BEIN` BEFORE INSERT ON `sys_detframe`
 FOR EACH ROW BEGIN 
 DECLARE iCodSiguiente  int(3) DEFAULT 0;
 DECLARE cCodFormulario int(8) DEFAULT 0;
 -- colocamos el indice siguiente de forma automatica 
 -- teniendo en cuenta el orden de los anteriores input
 -- pertenecientes al mismo frame
 SELECT IF(MAX(cod_indice) IS NOT NULL, MAX(cod_indice)+1,0)
   INTO iCodSiguiente 
   FROM sys_detframe
  WHERE cod_frame=new.cod_frame;
  IF new.cod_indice is null Or new.cod_indice=0 THEN
   SET new.cod_indice = iCodSiguiente;
  END IF;
 -- segun el tipo de input relacionamos los archivos adjuntos para su correcto funcionamiento
 -- seleccionamos el cod_fomulario que contiene los frames

END
//
DELIMITER ;

