--
DROP TRIGGER IF EXISTS `sys_usuario_BEDE`;
DELIMITER //
CREATE TRIGGER `sys_usuario_BEDE` BEFORE DELETE ON `sys_usuario`
 FOR EACH ROW BEGIN
	-- borramos los perfiles relacionados
	DELETE FROM sys_usuario_perfil WHERE cod_usuario=old.cod_usuario;
    -- borramos las empresas relacionadas
	DELETE FROM sys_usuario_empresa WHERE cod_usuario=old.cod_usuario;
    -- borramos los menus y submenus relacionados
    DELETE FROM sys_usuario_menu WHERE cod_usuario=old.cod_usuario;
    DELETE FROM sys_usuario_menu_sub WHERE cod_usuario=old.cod_usuario;
    DELETE FROM crm_productos_usuario WHERE cod_usuario=old.cod_usuario;
    -- DELETE FROM datolee_sublider WHERE cod_sublider = old.cod_usuario;
END
//
DELIMITER ;

