--
-- Disparadores `sys_usuario_empresa`
--
DROP TRIGGER IF EXISTS `sys_usuario_empresa_BEFORE_INSERT`;
DELIMITER //
CREATE TRIGGER `sys_usuario_empresa_BEFORE_INSERT` BEFORE INSERT ON `sys_usuario_empresa`
 FOR EACH ROW BEGIN
 DECLARE iCount  int(1) DEFAULT 0;
 SELECT count(1)
   INTO iCount
   FROM sys_usuario_empresa
  WHERE cod_usuario= new.cod_usuario
    AND ind_principal=1;
 IF iCount=0 THEN
  SET new.ind_principal=1;
 END IF;
END
//
DELIMITER ;

